INSERT INTO `recos` VALUES (100000000,'Automatic remember user','2015-05-21 02:43:04','2016-02-17 10:04:46','[Recoeve]--개발--Done','Automatic remember user','','지금은 3시간 지나면, session out 인데... 이거 remembered cookie 있으면 자동적으로 remember 된 다음 reco/edit/del 수행 바로 되도록.','4.5/5',0,0,0),(100000000,'cat=','2015-05-02 21:08:25','2015-05-02 21:08:25','','Category - Uncategorized','cats=\"\" (empty) 일때에는 여기로 reco 가 저장됨.','',NULL,0,0,0),(100000000,'cat=[IT/Programming]','2015-05-03 20:39:20','2015-05-03 20:39:20','[IT/Programming]','Category - [IT/Programming]','IT 및 Programming 관련 recos.','',NULL,0,0,0),(100000000,'cat=[Recoeve]','2015-05-03 21:09:08','2015-05-03 21:09:08','[Recoeve]','Category - Recoeve','Recoeve 관련. 철학이나 경영에 관련된 이야기들도.','',NULL,0,0,0),(100000000,'cat=[지도/여행]','2015-05-04 14:42:33','2015-06-09 14:19:01','[지도/여행]','Category - [지도/여행]','','지도 관련해서는 reco 못할듯.\n(따로 URI 를 잘 디자인 해놓은 map 을 찾지 않는 이상... 혹은 직접 만들거나?)',NULL,0,0,0),(100000000,'Change orders catList cancel 일때 catList 모두 expand 되는거 해결할까?','2015-05-07 14:31:50','2015-05-19 15:13:21','[Recoeve]--개발--Done','Change orders catList cancel 일때 catList 모두 expand 되는거 해결할까?','','그냥 놔둘까? 좀 더 엄밀히는 이전 expand shrink 기억해두고 똑같이 처리해 주는게 좋긴 한데...\n\nexpand shrink 기억해두고 똑같이 처리되도록 만듬.','5.0/5',0,0,0),(100000000,'Gabriel','2015-12-17 16:10:50','2019-07-27 01:27:42','[정치/사회/경제]--종교','Gabriel (\"God is my strength\")','Gabriel (\"God is my strength\"):가브리엘 (\"신이 나의 힘이다\"):\n\nOne of the two highest ranking angels. \n계급이 가장 높은 두 명의 천사 중 한명.\n\nHe is the angel of mercy, annunciation, resurrection, vengeance, death and revelation.\n그는 자비, 성수태 고지(마리아에게 예수 잉태를 알린 것.), 부활, 복수, 죽음과 계시의 천사이다.\n\nHe presides over paradise and is the ruling angel of the first heaven.\n그는 낙원(paradise)을 관장(관리)하며 제1천국(the first heaven)의 지배천사이다.\n\nThis archangel is a primary messenger of God, bringing divine announcements and revelations to humankind, acting as an intermediary between heaven and earth and helping us to interpret our dreams and our visions. \n이 대천사는 하늘과 땅 사이의 중개자 역할을 하며, 우리의 꿈과 우리의 비전을 해석하는 데 도움을 주고, 인류에게 신의 공지 및 계시를 전달하는, 신의 수석(primary) 전달자(messenger)이다.\n\nGabriel grants wishes and hopes to mortals, as well as joy, mercy, understanding of mysteries, truth, justice, miracles and love. \n가브리엘은 필멸자(인간)들에게 소망과 희망뿐 아니라 기쁨, 자비, 불가사의(mysteries)의 이해, 진실, 정의, 기적과 사랑을 허락한다.\n\nEssene prayer: \"Gabriel, Angel of Life. Enter my limbs and give your whole strength to me\".\n에세네파의 신도(고대 유대의 금욕/신비주의의 한 파)의 기도: \"가브리엘, 생명의 천사여. 내 사지에 들어와 나에게 당신의 모든 힘을 주소서.\"','','10.0/10',0,0,0),(100000000,'http://19report.president.pa.go.kr/main.do','2022-07-18 02:49:44','2022-07-18 02:49:44','[정치/사회/경제]--정치','19대 대통령 문재인 기록물','','','10.0/10',0,0,0),(100000000,'http://1boon.kakao.com/share/stopmeatdiet?dmp_channel=healthtip','2017-02-08 04:05:40','2017-02-08 04:05:40','[음식/요리/건강]--건강','고기 끊으면 우리 몸에 생기는 변화','','뭐든 골고루 먹는게 중요한듯.','8.0/10',0,0,0),(100000000,'http://940830.co.kr/default/','2015-05-22 14:10:03','2015-05-22 14:10:03','[Music/Break]--KARA--Fan site','영지꽃 - 허영지 팬사이트','','영지 팬사이트도 만들어지긴 했구나ㅋ','5.0/5',0,0,0),(100000000,'http://9gag.com/','2015-05-30 03:24:26','2015-05-30 03:24:26','[Bookmarks]--해외 유머 사이트들','9gag.com','','',NULL,0,0,0),(100000000,'http://alleciel.com/2015/05/05/ev-williams-rules-quality-content-clickbait-age/','2015-05-07 11:57:06','2015-05-07 11:57:06','[Recoeve]--심리/경향;Later','“글은 가장 강력한 형태의 미디어다” MEDIUM을 만든 남자, 에반 윌리엄스가 발견한 7가지 교훈','','',NULL,0,0,0),(100000000,'http://alleyway.kr/','2016-01-31 11:24:21','2016-03-17 22:47:38','Later','alleyway.kr :: 거풍 (거리의 풍경, unviajero) \'s blog','','',NULL,0,0,0),(100000000,'http://andrew.gibiansky.com/blog/machine-learning/hessian-free-optimization/','2017-08-18 00:10:20','2017-08-18 00:10:20','[IT/Programming]--기계학습','Hessian Free Optimization','','','8.2/10',0,0,0),(100000000,'http://apod.nasa.gov/apod/ap150628.html','2015-06-29 11:08:08','2015-07-02 05:40:46','[Physics/Math/Science]--Physics--Astronomy Picture of the Day','All the Colors of the Sun','All the Colors of the Sun \nCredit & Copyright: Nigel Sharp (NSF), FTS, NSO, KPNO, AURA, NSF\nExplanation: It is still not known why the Sun\'s light is missing some colors. Here are all the visible colors of the Sun, produced by passing the Sun\'s light through a prism-like device. The spectrum was created at the McMath-Pierce Solar Observatory and shows, first off, that although our white-appearing Sun emits light of nearly every color, it does indeed appear brightest in yellow-green light. The dark patches in the above spectrum arise from gas at or above the Sun\'s surface absorbing sunlight emitted below. Since different types of gas absorb different colors of light, it is possible to determine what gasses compose the Sun. Helium, for example, was first discovered in 1870 on a solar spectrum and only later found here on Earth. Today, the majority of spectral absorption lines have been identified - but not all.\n\n#related\nhttp://apod.nasa.gov/apod/image/1506/sunspectrum_noao_960.jpg','','10.0/10',0,0,0),(100000000,'http://apod.nasa.gov/apod/ap150702.html','2015-07-02 05:37:01','2015-07-02 05:40:34','[Physics/Math/Science]--Physics--Astronomy Picture of the Day','Venus and Jupiter are Close','#related\nhttp://apod.nasa.gov/apod/image/1507/VenusandJupiterareClose_WangLetian1024.jpg\n\n#Composite Image Credit & Copyright: Wang, Letian\n#Explanation: On June 30, Venus and Jupiter were close in western skies at dusk. Near the culmination of this year\'s gorgeous conjunction, the two bright evening planets are captured in the same telescopic field of view in this image taken after sunset from Bejing, China. As the two bright planets set together in the west, a nearly Full Moon rose above the horizon to the south and east. Imaged that night with the same telescope and camera, the rising Moon from the opposite part of the sky is compared with the planetary conjunction for scale in the digitally composited image. The full lunar disk covers an angle of about 1/2 degree on the sky. Visible as well in binoculars and small telescopes are Venus\' crescent and Jupiter\'s four Galilean moons. Of course, Venus and Jupiter are still close.','왼쪽 위가 목성, 아래가 금성, 오늘쪽이 달 인듯.','10.0/10',0,0,0),(100000000,'http://apod.nasa.gov/apod/astropix.html','2015-05-02 03:45:30','2015-05-02 03:45:30','[Physics/Math/Science]--News','Astronomy Picture of the Day','Discover the cosmos! Each day a different image or photograph of our fascinating universe is featured, along with a brief explanation written by a professional astronomer.','NASA 에서 운영하는 사이트. 매일 우주관련, 과학관련 사진을 업로드 함.\n사이트가 css 적으로 좀 덜 꾸며져있는게 아쉽.','4.5/5',0,0,0),(100000000,'http://appsurprise.co.kr/','2015-05-04 08:37:22','2015-05-04 08:38:28','[IT/Programming]--App','App Surprise 써프라이즈','각종 세일 정보들 (의류, 화장품, 음식 등) 을 잘 정리해서 보여주는 사이트.','학교 후배가 창업해서 만든 서비스. 완전 깔끔하게 잘 만든듯ㅋ. 나중에 내 서비스가 성공하면 M&A (Mergers and Acquisitions) 하고 싶어진다? =ㅇ=\n\n난 당장 수입이 없어서 푸드쪽 http://appsurprise.co.kr/%EC%84%B8%EC%9D%BC/%ED%91%B8%EB%93%9C 만 사용중이지만...','5.0/5',0,0,0),(100000000,'http://appsurprise.co.kr/%EB%B8%8C%EB%9E%9C%EB%93%9C/%EB%8F%84%EB%AF%B8%EB%85%B8%ED%94%BC%EC%9E%90/%EC%84%B8%EC%9D%BC','2015-06-09 09:53:00','2015-06-09 09:53:00','[음식/요리/건강]--음식점 할인정보','도미노피자 세일정보','','',NULL,0,0,0),(100000000,'http://appsurprise.co.kr/%EB%B8%8C%EB%9E%9C%EB%93%9C/%EB%A1%AF%EB%8D%B0%EB%A6%AC%EC%95%84/%EC%84%B8%EC%9D%BC','2015-06-09 09:45:58','2015-06-09 09:45:58','[음식/요리/건강]--음식점 할인정보','롯데리아 세일정보','','',NULL,0,0,0),(100000000,'http://appsurprise.co.kr/%EB%B8%8C%EB%9E%9C%EB%93%9C/%EB%A7%98%EC%8A%A4%ED%84%B0%EC%B9%98/%EC%84%B8%EC%9D%BC','2017-02-19 02:55:52','2017-02-19 02:55:52','[음식/요리/건강]--음식점 할인정보','맘스터치 할인정보','','','10.0/10',0,0,0),(100000000,'http://appsurprise.co.kr/%EB%B8%8C%EB%9E%9C%EB%93%9C/%EB%A7%A5%EB%8F%84%EB%82%A0%EB%93%9C/%EC%84%B8%EC%9D%BC','2015-06-09 09:52:22','2015-06-09 09:52:22','[음식/요리/건강]--음식점 할인정보','맥도날드 세일정보','','',NULL,0,0,0),(100000000,'http://appsurprise.co.kr/%EB%B8%8C%EB%9E%9C%EB%93%9C/%EB%B2%84%EA%B1%B0%ED%82%B9/%EC%84%B8%EC%9D%BC',