> 호환성 => 높은 DPI 설정에서 디스플레이 배율을 사용하지 않음. 체크','단축키가 없는게 아쉽다;;;','9.0/10',0,0,0),(100000000,'http://blog.naver.com/alsn76','2015-09-30 08:06:07','2015-09-30 08:06:07','[정치/사회/경제]--역사','레알뻘짓 블로그 (alsn76 - 만쭈리)','','재밌게 쓴 역사 이야기들.','9.0/10',0,0,0),(100000000,'http://blog.naver.com/alsn76/220235940614','2015-09-30 11:19:50','2016-05-30 05:28:53','[정치/사회/경제]--역사--대한민국','이승만라인+독도밀약 : 독도는 과연 우리 땅인가? 왜 우리 땅인가?','','토지 소유권에 대해서 생각해 볼만한 글?\n\n뭐 개인적으론 미리 눌러 앉았다고 자기 땅이 되는건 아니라고 생각하지만... 지키려면 (혹은 눌러 앉으려면) 군사력도 있어야 할거고, 아니면 쳐들어 오려는 다른 사람에게 무언가 다른것들을 제공하거나... 뭐 이런면에서 소유에 영원한건 없긴 할듯.\n\n토지나 건물 소유권도 마찬가지라고도 보긴 하는데... 국가 정책 및 세금 (토지세, 종합 부동산세) 등으로 소유권리가 왔다리 갔다리 할듯? 토지 세금을 못버티면 팔아야 할테니.\n\n아무튼 핵심은 독도밀약 (1965년 1월) 이었던거 같네.\n1. 독도는 앞으로 대한민국과 일본 모두 자국의 영토라고 주장할 수 있고, 여기에 양국은 이의를 제기하지 않는다.\n2. 장래에 어업구역을 설정할 경우 양국은 독도를 자국 영토로 편입하여 선을 그을 수 있으며, 이때 두 선이 중복되는 부분은 공동수역으로 한다.\n3. 현재 대한민국이 \'점거\'한 현상을 유지한다. 그러나 경비원을 증강하거나 새로운 시설의 건축이나 증축은 하지 않는다.\n4. 양국은 이 합의를 계속 지켜 나아간다.\n\n요 밀약 바탕으로 독도 중심으로 한일중간수역 같은 한일어업협정 (1998년 10월) 을 맺었고.','8.6/10',0,0,0),(100000000,'http://blog.naver.com/alsn76/220472681601','2015-09-30 12:49:19','2015-09-30 15:31:15','[정치/사회/경제]--역사--대한민국','박정희의 핵개발 : 왜 핵폭탄을 만들려 했는가? + 진짜 의도','','','7.8/10',0,0,0),(100000000,'http://blog.naver.com/alsn76/220479137849','2015-10-03 07:36:19','2015-10-03 08:41:39','[정치/사회/경제]--역사--일본','일본의 고대사 ① : 일본은 어떻게 탄생했나 + 왜 한반도는 일본 역사의 모태인가?','','호모 에렉투스 등 인류의 기원부터 어느정도 설명되어 있음. 재미지고 신기하당;;; 나 학교다닐때 국사/역사는 이상한 것들만 막 외우게 하고 재미 없었던거 같은데...ㅋ\n\n일본의 지리적 특성 때문에 신석기 시대에도 농사없이 대부분 수렵과 채집으로 생활을 이어 갔다고.\n\n\"천연두, 홍역, 수두, 인플루엔자 등은 모두 인류가 가축을 기르면서 얻어진 질병들\"이란 것도 신기 =ㅇ=;;;','8.7/10',0,0,0),(100000000,'http://blog.naver.com/alsn76/220480735862','2015-10-03 07:40:41','2015-10-03 07:40:41','[정치/사회/경제]--역사--일본','일본의 고대사 ② : 백제 유민들의 집단 이주 + 중앙집권국가로의 성장','','','8.5/10',0,0,0),(100000000,'http://blog.naver.com/alsn76/220498364492','2015-10-03 14:45:57','2015-10-03 14:57:36','[정치/사회/경제]--역사--일본','일본의 중세사 ② : 한·일 국력의 역전은 언제부터였을까? + 몽골의 일본 침략','','고려때 몽골(원)한테 정복당하고 일본을 같이 쳤