 내는거나.\n손님이 결제할때 90%는 이 상점주인한테 가는거고 10%는 세금으로 나가는구나 하고 느끼면서 결제하는거나.\n거기서 거기인데 ㅡ..ㅡ;;\n\n뭔 법률이 사람들 심리에 따라서 처벌하는 규정을 두는듯한 느낌이?\n어차피 돈 흐름은 똑같은건데.. 현금 결제시엔 정부를 속인채 둘만 은밀히 거래하면서 세금을 안낼수 있다 뿐인것일뿐.\n\n\"부담하게 하여서는 아니된다.\"가 아니라 \"정부를 속이고 세금을 안내면 아니된다.\"가 되어야 맞는 법률 같은데...\n\nps. 이런글엔 왜 부가가치세가 생겼고, 어떤 의미로서 정부가 개인이나 기업의 거래에서 총 금액의 10%를 세금 명목으로 떼어가는지에 대한 타당성/정당성이 있는지를 설명해 주셔야 할듯. 현금 거래해서 부가가치세 안내면 불법인거야 누구나 알지만, 다들 아까우니까 안나가도 될 돈 같은데 나가는거 같아서 아깝게 생각되니까 그렇게 하는거겠죠.\n\nA 랑 B 랑 거래를 하는데 이틀에 한번씩 A 가 B 에게 100 만원 주고, 다음날 B 가 A 에게 100만원 주고 하는 거래를 30일간 한다면. A 랑 B 는 둘 다 들어온 수익은 0원일텐데... 이 사이에서 부가가치세를 걷어가면 둘다 한번 거래할때마다 10만원씩 30일간 300만원이 둘 사이에서 세금 명목으로 정부가 걷어가는 식인거 아닌가요? 그럼 이 둘은 원래 0원 0원 이었어야 하지만 세금 내야해서 -150만원, -150만원이 되는걸테고... 단지 둘이 열심히 서로 100만원씩 가치의 일을 주고 받으면서 서로가 잘하는 일을 대신 해주고 삶을 윤택하게 만들려고 하는 것이었을텐데. 정부가 해주는일도 없이 150만원씩 삥땅쳐 간다고 느낄지도...\n\n담부터라도 글을 좀 잘 써주시길... 깊이가 좀 있게...','1.0/5',0,0,0),(100000000,'http://blog.naver.com/moonjaein2/220562498440','2015-12-08 16:25:42','2015-12-08 16:26:46','[정치/사회/경제]--정치','문재인, 관훈클럽 초청 토론회 2015-12-08','1. 혁신 전당대회 관련\n2. 안대표 및 일부 의원 탈당 논란에 대해\n...\n8. 선거구 획정 문제\n9. 시대정신: 불평등, 불공정의 해소\n10. 야당 경제 정책기조','매번 정치관련 뉴스를 챙겨보지는 않는데 (맨날 싸우기만 하는거 같고 짜증나고 그래서), 대충 문재인 대표의 생각을 정리해서 볼 수 있는 글이 뜬거 같은...\n\n뭐 개인적으로 문재인씨를 괜찮게 보고 있기도 해서, 잘 해내실거 같음. 주변에서 좀 도와줘야 할텐데... 도움주는 사람은 딱히 눈에 띄지는 않는듯도? 뭐 많이들 도와줄거 같은데, 시비거는 사람이 더 튀기 마련이라 그렇게 보이는지도...','8.3/10',0,0,0),(100000000,'http://blog.nec.go.kr/220529619439','2015-11-20 19:56:10','2015-11-20 19:56:10','[정치/사회/경제]--정치','중앙선거관리위원회 공식블로그 - 신용카드 포인트로 정치후원금 기부해요!!','','','8.2/10',0,0,0),(100000000,'http://blog.newstapa.org/kychoi/2739','2015-12-14 08:06:17','2015-12-14 08:06:17','[정치/사회/경제]--경제--대한민국','아파트 분양 시장 ‘작업의 정석’','','정보 비대칭...','8.5/10',0,0,0),(100000000,'http://blog.outsider.ne.kr/','2015-05-06 02:32:53','2015-05-06 02:33:13','[Bookmarks]--Programmer','Outsider\'s Dev Story','','개발/Programming 관련 좋은 글들이 너무 많음.','5.0/5',0,0,0),(100000000,'http://bogun.nodong.org/xe/index.php?mid=khmwu_5_7&document_srl=334372','2015-06-14 14:22:05','2015-06-28 23:00:52','[정치/사회/경제]--사건사고--2015-05 메르스','보건의료노조 메르스 상황판','','',NULL,0,0,0),(100000000,'http://cafe.daum.net/Dejuanholic','2015-05-21 12:25:08','2015-05-21 12:25:08','[Music/Break]--KARA--Fan site','KARA with Kamilia - 공식 팬카페','','','5.0/5',0,0,0),(100000000,'http://cafe.daum.net/Dejuanholic/K9QU/441','2015-05-15 14:07:13','2015-05-16 04:53:00','[Music/Break]--KARA--햄사진','5월 20일에 승연이와 함께하는 급만남 이벤트','5월 20일에 승연이와 함께하는 급만남 이벤트가 진행됩니다~\n\n신청 시간은 5월 16일 0시부터 낮 3시까지 신청 받습니다.\n\n급만남 이벤트 게시판에 신청 게시글을 올려주시면 되고,\n신청 양식은 [이름/전화번호/본인사진/본인이 뽑혀야 하는 이유] 이며,\n이름/전화번호/사진은 필수기재입니다. \n\n비밀메모 체크 해서 올려주시면 승연이가 직접 선택한 인원들로 급만남 이벤트가 진행됩니다.\n\n장소와 정확한 일정은 당첨자 공지 후 개별 연락으로 알려드립니다.\n\n일정을 모두 촬영할 예정이오니, 이점을 잘 숙지하시고 신청 바랍니다.','DSP 는 보안 신경 쓰길...\n햄덕들에게 행운이 있기를ㅋㅋㅋ.\n음 나도 잠시 햄토리로 갈아타고 신청해볼까 ㅡ..ㅡ;;; 심히 고민되네...','5.0/5',0,0,0),(100000000,'http://cafe.daum.net/Dejuanholic/K9QU/445','2015-05-18 13:27:29','2015-05-18 13:44:47','[Music/Break]--KARA--여신님','여신님과 함께 하는 이벤트','안녕하세요. DSP미디어입니다.\n\n규리 양의 생일을 맞이하여, 팬분들과 함께 봉사 활동을 진행할 예정입니다.\n\n생일을 맞이하여 팬분들과 뜻깊은 자리를 마련하고자 하는 규리 양의 의견으로 진행되는 만큼\n좋은 취지로 봉사에 참여하실 분들의 많은 참여 부탁드립니다.\n\n\n<행사 일시>\n2015년 05월 21일 (목) 오전 (자세한 일정은 개별 공지)\n\n<신청 기간>\n2015년 05월 18일 PM 11:00 ~ 05월 19일 PM 04:00까지.\n\n<신청 방법>\n[깜짝 이벤트] 게시판에 양식에 맞춰 비밀 메모를 체크한 뒤, 신청글을 올린다.\n\n<신청 양식>\n[이름/전화번호/ 봉사 활동을 함께 하고 싶은 이유]\n\n\n장소와 정확한 일정은 당첨자 공지 후 개별 연락으로 알려 드릴 예정입니다.\n또한, 봉사 활동이 오전에 진행되는 만큼 진행 시간을 꼭 숙지하신 뒤 신청해 주시길 바랍니다.\n\n감사합니다.','','5.0/5',0,0,0),(100000000,'http://colah.github.io/posts/2015-08-Understanding-LSTMs/','2017-09-13 08:14:12','2017-09-14 01:54:29','[IT/Programming]--기계학습;[IT/Programming]--기계학습--RNN','colah\'s blog - Understanding LSTM (Long Short Term Memory) Networks','','','9.0/10',0,0,0),(100000000,'http://comic.naver.com/bestChallenge/list.nhn?titleId=584696','2015-05-04 07:38:33','2015-05-04 07:38:33','[Music/Break]--웹툰','지구와 사람과 동물','지구에 살았던 살고 있는 모든 동물들의 소소한 이야기입니다.','소소한 동물들 이야기. 재미지면서 유익하다(?) 신기하다(?).\n무엇보다 그림체가 이쁨. 귀욤귀욤화.','4.5/5',0,0,0),(100000000,'http://c