-Physics--Quantum Mechanics','extrad.egloos.com - 표준모형','양자전기역학(QED)에 노벨상이 수여된 해가 1965년. 따라서 올해는 그 50년이 되는 해다. 지난 50년간 인류는 자연의 기본힘 4(혹은 3)개의 작동 원리를 밝혀냈고, 물질의 근본이 되는 12종류의 입자와 이에 질량을 부여하는 힉스장의 양자인 힉스 입자를 찾아냈다. 그 결과 우리는 우리 우주를 구성하는 에너지의 대략 5%에 대해 상당한 지식을 갖게 된 것이다. 나머지 95%에 해당하는 ‘암흑 성분’에 대해서는 여전히 지식이 부족하다.','표준모형 (Standard Model of particle physics), 양자전기역학 (QED) 에 대한 개괄적인 설명/소개. (Introduction)\n\n물리학의 근본적인 법칙들은 더 깔끔할것도 같은데, 표준모형는 뭔가 동물원식(?)의/현상론적인(?) 결론을 낸듯해서 불완전한 이론이라는 느낌도 있는듯... (뭐 내 개인적인 느낌이ㅋ)\n\n입자 가속기 실험에서 나오는 결과들을 하나둘씩 계속해서 다 설명하려다 보니까 계속 뭔가를 도입하고 (기본 입자들 수를 하나둘씩 늘린다던지), 방정식의 변수를 하나둘씩 늘리고 하면서 어거지로 설명한 느낌도?ㅋ (그래도 최소한의 변수가 되도록 노력한다던지, 통일성/대칭성/단순성 있게 정리하긴 한듯)\n\n아무튼 지금까지의 물리현상들 (특히 입자 가속기 실험의 결과들) 을 가장 정확하게 예측하고 설명하고 있는 표준모형이란게 어떻게 발전되어 왔고, 어떤 이론인지를 개괄적으로 잘 설명해 놓으신듯. (뭐 나도 이쪽 전공은 아니었어서;;; 제대로는 모르긴 함.)','4.5/5',0,0,0),(100000000,'http://extrad.egloos.com/4132704','2017-04-23 11:41:07','2017-04-23 11:41:07','[Physics/Math/Science]--Math','라플라스 연산자','','','10.0/10',0,0,0),(100000000,'http://extrad.egloos.com/4209827','2022-07-15 23:50:27','2022-07-15 23:50:27','[Physics/Math/Science]--Physics','힉스 입자 발견 10년후 --1탄','#related\nhttps://www.nature.com/articles/s41586-022-04893-w\nhttps://www.nature.com/articles/s41586-022-04892-x','','10.0/10',0,0,0),(100000000,'http://fast-track.asia/','2015-05-06 01:22:45','2015-05-06 01:22:45','[Recoeve]--투자','Fast Track Asia','','',NULL,0,0,0),(100000000,'http://fateflysy.kr/xe/index','2015-05-07 13:06:12','2015-05-19 16:55:41','[Music/Break]--KARA--Fan site','Eternal Sunshine - 한승연 팬사이트','','','5.0/5',0,0,0),(100000000,'http://firejune.com/','2015-05-06 02:34:13','2015-05-06 02:34:13','[Bookmarks]--Programmer','Firejune - The Web is still changing.','','',NULL,0,0,0),(100000000,'http://gabrielecirulli.github.io/2048/','2017-02-07 04:55:08','2017-02-07 04:55:08','[Music/Break]--게임','2048','','','8.0/10',0,0,0),(100000000,'http://gall.dcinside.com/board/lists/?id=hara','2015-05-08 23:27:44','2015-05-08 23:27:44','[Music/Break]--KARA--H