들다고 결론이 나게 되었습니다. \n\n저희가 투자를 진행하지 못하는 이유는 다양하고, 저희도 고객 중의 하나에 불과하기 때문에 판단이 틀릴 때가 있음을 고려하셔서 처음 가지셨던 믿음과 의지로 사업을 해 나가시길 바랍니다. 멀리서나마 사업 번창하시고, 건승하시기를 응원하겠습니다. \n\n감사합니다.\"\n\n========================================\n\n2015년 12월에도 다시 한번 보내봤지만... 다음과 같은 답변만.\n\n\"안녕하세요, 케이큐브벤처스 입니다.\n\n먼저 저희 케이큐브를 생각해 주셔서 감사의 말씀 드립니다. 보내 주신 사업계획 관련하여, 몇일 간 저희가 고민을 많이 해 본 결과 아쉽게도 이번 투자는 어렵다는 결정을 내렸음을 전해 드립니다.\n\n쉽지 않은 결정이었고, 또한 투자 심사 과정에 있어 다양한 요소가 고려 되는 만큼, 추가 진행이 어려운 이유를 콕 집어서 말씀 드리기에도 어려운 점을 양해 부탁 드리는 바입니다.\n\n저희 케이큐브도 수많은 투자사들 중 하나에 지나지 않기 때문에, 저희의 현재 판단이 틀릴 수 있음과, 또한 앞으로 어떠한 방향으로든 귀사가 잘 성장하여 대표님의 큰 뜻을 이루시기를 바라고 있음을 생각해 주셨으면 좋겠습니다.\n\n멀리서나마 사업 번창하시고 건승하시기를 항상 응원 드리도록 하겠습니다.\n\n감사합니다.\n\n케이큐브벤처스 드림.\"\n\n========================================\n\n국내 투자사들은 게임 쪽에 많이 투자하는 듯도 하고...\n이미 이런 (SNS 혹은 개인화된 추천시스템) 스타트업에 여러번 투자를 했었었는데, exit 결과가 그리 좋지 못해서 더는 투자를 안한다는 느낌도 있음. 암튼 투자 없이도 잘 버텨왔으니, 계속 개발은 열심히 해야지.','7.0/10',0,0,0),(100000000,'http://keithclark.co.uk/','2015-12-14 00:02:45','2015-12-14 00:02:45','[IT/Programming]--Portfolio Examples--Web front-end','Front-end Web Developer - keithclark.co.uk :: Keith Clark','','Web 으로 만든 games, CSS 3D engine, js 들 나열. 추가로 Personal Achievements, Referenced in… (자기가 한 일이 여러사람들 책에 소개되었다는 이야기. 대부분 기술관련 책들.) 등이 있음.\n\nCSS 로 3D 구현한게 인상적.\n\nA 3D environment with lighting, shadows built with CSS transforms. 좀 짱인듯.','10.0/10',0,0,0),(100000000,'http://kgsa.sites.yale.edu/sites/default/files/files/recruit/2014/DecemberCompany.pdf','2015-12-15 03:52:56','2016-03-07 06:36:45','[Recoeve]--채용','December & Company 채용 공고','#related\nhttp://m.thebell.co.kr/m/newsview.asp?svccode=00&newskey=201511030100004960000280','신기한 회사네.','7.0/10',0,0,0),(100000000,'http://kipid.tistory.com/','2016-11-15 12:02:07','2016-11-15 12:02:07','','kipid\'s blog :: kipid\'s blog','','',NULL,0,0,0),(100000000,'http://kipid.tistory.com/attachment/cfile23.uf@2479974D54DF0A5D0A55E0.mp4','2015-05-05 14:39:29','2015-05-17 04:19:46','[Music/Break]--KARA--HARA--On and Off','하라 온앤오프 - 마무리 인사','#r