영향을 주지 못했겠지만, 이젠 전세계가 영향을 서로 주고 받는 시대로 왔으니? 인터넷도 있고...)\n\n아무튼 이런 내 주변 세상, 내 현실/조건에 떨궈진 나는 어떤 전략으로 살아남아야 할래나? ㅡ,.ㅡ;;; 뭐 이런거 연구하는 사람은 사회가 어떻게 될지가 궁금해서 연구하는것도 있겠지만, 읽는 사람 개인들 입장에서는 이런걸 알아서 본인이 어떻게 살아남아야 할지를 생각할테니?ㅋ\n\n그런면에서 또 생각하면, 살아남는 전략은 숨기는게 이득일까, 같이 공유하는게 이득일까;;;;; 오픈소스랑도 연관된거 같고... 세상 참 복잡시럽다.','9.0/10',0,0,0),(100000000,'http://m.dcinside.com/view.php?id=hara&no=306706&page=1','2015-12-22 10:52:37','2015-12-22 10:53:29','[Music/Break]--KARA--HARA--사진','2015-12-19 : 소림사 하라움짤 by 카라풀 in dcinside','#related\nhttp://i.imgur.com/bTDwUHk.gif\nhttp://i.imgur.com/a865dVS.gif\nhttp://i.imgur.com/iGYWh1A.gif\nhttp://i.imgur.com/rz6INGS.gif\nhttp://i.imgur.com/rOy4tbj.gif\nhttp://i.imgur.com/OIFxXGG.gif\nhttp://i.imgur.com/PNww7iF.gif\nhttp://i.imgur.com/HeyIZG9.gif\nhttp://i.imgur.com/W8xWRBw.gif\nhttp://i.imgur.com/pcucuAS.gif\nhttp://i.imgur.com/PPNlPqW.gif\nhttp://i.imgur.com/GJC34tZ.gif\nhttp://i.imgur.com/PNIXuTt.gif\nhttp://i.imgur.com/z3C98Cm.gif\nhttp://i.imgur.com/qDZhJKx.gif\nhttp://i.imgur.com/6uTeB8b.gif\nhttp://i.imgur.com/hNQ3dln.gif\nhttp://i.imgur.com/uxaiysb.gif\nhttp://i.imgur.com/RaIdb10.gif\nhttp://i.imgur.com/JN1rjRs.gif\nhttp://i.imgur.com/4OldGZp.gif\nhttp://i.imgur.com/PHpjySm.gif\n마지막은 옛날꺼','짱귀여워!!!!!','10.0/10',0,0,0),(100000000,'http://m.map.daum.net/actions/theme/main?id=106','2015-06-10 04:23:51','2015-06-12 04:12:16','[정치/사회/경제]--사건사고--2015-05 메르스','메르스 지도 by 다음','','다음에서 만든 메르스 지도.\n\n전문가들이 뭉쳐서 만든만큼 꽤나 잘 만들어진듯? 하지만 여전히 UI/UX 가 아주 깔끔하다고는 못느끼겠는;;;\n\n이건 우리나라 IT 회사들의 공통점인듯도... 인터넷 회선이 빠르고 다들 최신폰, 최신 컴퓨터들을 써서 그런건가? 뭔가 세세한 부분들에 신경쓰지는 않는듯한 느낌. 돈이 안되는 분야라고들 생각해서 대충 만드는거 같기도 하고...\n그런데 돈 되는 분야에서도 UI/UX 가 거지같은거 많은데... 알수없다ㅋ. 그냥 소프트웨어 분야에서는 후진국이라 그런지도;;;','4.5/5',0,0,0),(100000000,'http://m.media.daum.net/m/media/culture/newsview/20151212205009558','2015-12-12 15:59:13','2015-12-12 16:01:29','[음식/요리/건강]--건강','SBS - 10분 간 기름에 볶고 튀기는 요리했더니..충격 결과','','역시나 기름이 문제인가. 기름류 많이 쓰는 조리법이 건강에는 많이 안좋은거 같음. 오메가 3, 6 비율도 그렇고...\n\n기름 안쓰고 조리했을때도 큰 차이 없는건가?','9.0/10',0,0,0),(100000000,'http://m.media.daum.net/m/media/digital/newsview/20151209100108419','2015-12-09 16:36:53','2015-12-09 16:42:07','[Physics/Math/Science]--Physics--Quantum Computer','연합뉴스 - NASA 최신 양자컴퓨터 공개..구글 \"일반 1억배 속도 확인\"','#related\nhttp://arxiv.org/abs/1512.02206 ArXiv - What is the Computational Value of Finite Range Tunneling?','느리지만 발전은 하고 있는듯?','7.6/10',0,0,0),(100000000,'http://m.media.daum.net/m/media/society/newsview/20150623102206229','2015-07-02 07:46:35','2015-07-02 07:46:35','[정치/사회/경제]--사건사고--2015-05 메르스','국민일보 - \"정부는 왜 그랬을까요\" 메르스 숙주병원의 고백 파문','1. 5월20일 환자 첫 발생시, 정부는 밀접접촉 10여명만 격리조치 하라고 함.\n\n2. 평택성모병원은 코호트(환자 발생 병동을 의료진과 함께 폐쇄해 운영) 격리를 하려고 했으나 정부가 지침에 적혀있지 않다면 막았음.\n\n3. 결국 확산을 막기 위해 5월29일 평택성모병원은 자진 폐쇄 결정을 함.\n\n4. 폐쇄시 정부는 ‘메르스’라는 단어를 말하지 못하게 함. 그래서 병원은 환자들에게 폐쇄이유를 보수공사 때문이라고 말할 수밖에 없었음.\n\n5. 병원이 환자를 치료하겠다고 했지만 정부는 환자들을 강제퇴원 시키라고 함. 감염 가능성에 대한 고지도 없었음. 결국 그 환자들이 흩어져서 다른 병원에도 옮김.','','9.2/10',0,0,0),(100000000,'http://m.mediatoday.co.kr/news/articleView.html?idxno=122967','2015-05-02 16:51:23','2015-05-02 17:07:19','[정치/사회/경제]--사건사고--세월호 침몰사고','미디어오늘 - 송강호·김혜수·박찬욱 등 “지킬게 거짓뿐인 朴 필요없다”','- 문화예술인 594명 세월호 정부 시행령 폐기 지지 선언 “헌법에 따라 특별조사위 독립성 지켜야”\n\n#at 2015.05.02\n#by 김도연 기자 riverskim@mediatoday.co.kr','1년이 넘었네 벌써...\n진상조사가 뭐 이렇게 느리게 진행될까.','4.0/5',0,0,0),(100000000,'http://m.navercast.naver.com/mobile_contents.nhn?rid=20&contents_id=103078','2015-12-10 18:55:50','2015-12-10 19:04:47','[Physics/Math/Science]--Physics--Quantum Mechanics','네이버캐스트 :: ‘유령입자’의 변신을 확인하다 - 중성미자의 진동변환 발견','','\"중성미자에 질량이 존재함을 알게 했고, 이를 통해 기존에 정립했던 입자물리학의 표준모형에 보완이 필요함을 알려줬다.\"\n\n중성미자 실험들도 대단하네;;; 난 아직 잘 이해를 못한 부분이긴... 중성미자는 또 누가 주문한걸까나?ㅋ','9.0/10',0,0,0),(100000000,'http://m.navercast.naver.com/mobile_contents.nhn?rid=20&contents_id=104413','2015-12-09 20:02:17','2015-12-09 20:10:12','[Physics/Math/Science]--Physics','네이버캐스트 :: 빛의 과학 (2) 색의 탄생 - 빛은 어떻게 색이 되는가?','','시각세포, RGB 등의 이야기.\n\n인간의 빛 감지 장치인 눈이 다른식으로 동작한다면, 모니터가 RGB 를 사용해서 색을 표현하지 않았을수도 있을듯? 사람이 색을 인식하는 시각세포인 원추세포가 세종류 (각각 RGB color 에 가장 민감하게 반응하는?) 라서 RGB 세종류만으로 우리가 인식하는 대부분의 색을 모니터가 표현할 수 있는거 같기도 하고...\n\n뭐 색 자체가 여러가지 파장의 빛이 섞여서 우리눈에 들어오는거라서, 실제 색 (자연적으로 우리가 접하는 사물들의 색깔) 을 모니터가 흉내내려면 어떤 방법을 써야할지를 고민해보면 RGB 쓰는게 가장 간단하다는 결론이 나오는듯 함.\n\n실제 빛 spectrum 을 분석해보면 우리가 같은색이라고 인식하는 색들도 자연에서 나오는 색과 모니터에서 나오는 색이 확연하게 차이가 날수도 있겠지만? (자연빛은 여러 파장대 빛이 고르게 continuous spectrum 으로 섞여서 나오겠지만, 모니터 빛은 RGB 에서 peak 되는 형태로 나올듯?)','8.6/10',0,0,0),(100000000,'http://m.navercast.naver.com/mobile_contents.nhn?rid=20&contents_id=116482&leafId=20','2016-09-15 03:40:07','2016-09-15 03:40:07','[Physics/Math/Science]--Physics','시간의 탄생','','','8.5/10',0,0,0),(100000000,'http://m.navercast.naver.com/mobile_contents.nhn?rid=20&contents_id=94407','2015-12-10 18:46:18','2015-12-10 18:47:21','[Physics/Math/Science]--Physics--Relativity','네이버캐스트 :: 단위의 과학 - 킬로그램 원기는 다이어트 중','','뭐든지 기준을 잘 잡는게 중요. 특히나 물리학에서는 더욱 더...\n상대론의 근본적인 시작점이기도 한... \n\"물리량들의 기준은 어떻게 잡아야 할까?\"','10.0/10',0,0,0),(100000000,'http://m.post.naver.com/viewer/postView.nhn?volumeNo=4127335&memberNo=29770009','2016-04-28 03:56:51','2016-05-02 12:22:22','[Music/Break]--KARA--HARA--사진','구하라, 한류콘서트 MC도전! \"넌 감동이었어\"','','','10.0/10',0,0,0),(100000000,'http://m.star.naver.com/kara','2015-07-10 03:46:03','2015-07-10 03:46:03','[Music/Break]--KARA--Links','네이버 스타캐스트 - 카라','','','9.4/10',0,0,0),(100000000,'http://m.star.naver.com/kara/news/end?id=5481428&langCode=ko','2015-07-04 03:05:00','2015-07-04 03:05:00','[Music/Break]--KARA--Backstage','[카라이프] 마지막 이야기 : C.U.P.I.D 마지막 방송 기념, 카라의 역조공을 받아줘','','',NULL,0,0,0),(100000000,'http://m.star.naver.com/kara/news/end?id=5535261','2015-07-09 04:11:18','2015-07-10 04:09:30','[Music/Break]--KARA--HARA;[Music/Break]--KARA--Teaser','[스타캐스트] 구하라 솔로 데뷔, ALOHARA in KOSAMUI','#related\nhttp://serviceapi.rmcnmv.naver.com/flash/outKeyPlayer.nhn?vid=B6B43E8DEFAB336FB0925367BFE2BEBB9BF5&outKey=V12402d2d83f4a884b99c29717e6f14f6a6faa0fecf150111f1f029717e6f14f6a6fa&controlBarMovable=true&jsCallable=true&skinName=default\n\nhttp: