','6.1/10',0,0,0),(100000000,'http://news1.kr/articles/?2246990','2015-12-15 01:38:16','2015-12-15 01:38:16','[정치/사회/경제]--경제;[IT/Programming]--News','로봇이 야구기사를 쓴다…그런데 아주 잘 쓴다','','','8.8/10',0,0,0),(100000000,'http://newspeppermint.com/','2015-05-04 05:45:33','2015-05-04 05:45:33','[정치/사회/경제]','News Peppermint','뉴스페퍼민트는 최근 화제가 된 외신 중 우리에게 새로운 시각을 알려주는 기사를 중심으로 다양한 분야의 글 5편을 골라 번역/요약하여 월~금 오전 7시에 제공합니다.','외신 중 괜찮다고 생각되는 기사들을 선별해서 요약번역 해주심.\n좋은 기사들 참 많음. (영어로 읽기 귀찮은 것들 후딱 읽을 수 있어서 좋음.)\n\n요새 시간을 많이 못내고 있는게 아쉽당;;; 놓친 좋은 기사들 많을듯.','4.6/5',0,0,0),(100000000,'http://newspeppermint.com/2012/10/31/%EC%96%91%EC%9E%90%EC%97%AD%ED%95%99%EA%B3%BC-%EC%83%81%EB%8C%80%EB%A1%A0%EC%9D%98-%EC%97%B0%EA%B2%B0/','2016-12-21 12:03:42','2016-12-21 12:03:42','[Physics/Math/Science]--Physics--Quantum Mechanics','양자역학과 상대성 이론의 연결','','','6.8/10',0,0,0),(100000000,'http://newspeppermint.com/2013/01/14/왜-사람들은-페이스북에-끊임없이-무언가를-기록할/','2015-05-04 13:18:58','2015-05-04 13:18:58','[Recoeve]--심리/경향;[정치/사회/경제]--IT 시대','News Peppermint - 사람들이 페이스북에 끊임없이 무언가를 기록하는 이유','더 많은 페이스북의 사용이 행복감과 우울감에는 변화를 주지 않았던 데 비해, 외로움은 감소시키는 것으로.','트위터에 혼잣말을 떠들어도 외로움은 조금 감소되는듯? 그런데 이걸 읽고나니 뭔가;;; 이젠 혼잣말을 계속 떠들어도 외로움이 감소되지 않을거 같은?ㅋ','3.0/5',0,0,0),(100000000,'http://newspeppermint.com/2013/05/27/internet/','2015-05-04 05:25:07','2015-05-04 05:34:21','[Recoeve]--심리/경향;[정치/사회/경제]--IT 시대','News Peppermint - 사람들이 하루종일 인터넷에 매달리는 이유','보상이 즉각적으로 주어진다는 점 역시 인터넷의 유혹을 거부할 수 없게 만든다.','이건 다르게도 활용할 수 있을듯? 보상이 즉각적으로 주어지도록 여러가지를 설계해 놓으면 지치지 않고 꾸준히 무언가를 하게 할수도 있을거 같은데?\n\n게임에 중독되는 것 역시 바로바로 보상이 주어지기 때문이기도...? 뭐 중독을 좋은 방향으로 잘 활용하면 더 삶이 좋아질수도 있을거 같음.','4.0/5',0,0,0),(100000000,'http://newspeppermint.com/2013/08/08/trolling-on-twitter/','2015-05-14 10:20:44','2015-05-14 10:21:27','[정치/사회/경제]--심리','SNS 상의 트롤링, 어떻게 규제해야할까?','#원문\nhttp://www.economist.com/blogs/schumpeter/2013/08/abuse-twitter\neconomist.com - Abuse on Twitter, Troll attack, 2013-08-05, by W.B.\n\n#요약\n\"동시에 사용자들 스스로 트롤들을 공개된 곳으로 끌어내어 사회적인 낙인을 찍는 것도 효과적인 해결 방법이라고 지적합니다. 실제로 비어드 교수에게 악성 멘션을 보낸 한 남성은 다른 트위터 사용자가 이 사실을 어머니에게 이르겠다고 말하자 비어드 교수에게 사과하기도 했습니다. 비어드 교수는 이와 별개로 법적인 처벌도 강화되어야 한다고 주장합니다. 살해 협박은 어떤 채널을 통해서 오든 똑같은 살해 협박이라는 것이죠. 하지만 현재로서는 익명성과 사법 당국의 소극적인 대처가 소셜 미디어를 진흙탕으로 만들고 있는 것이 확실해 보입니다.\"','','4.0/5',0,0,0),(100000000,'http://newspeppermint.com/2013/12/18/obsession-with-external-recognition/','2015-05-06 10:14:48','2015-05-06 10:16:08','[Recoeve]--경영','인정받고 싶은 욕망의 위험성','#related\nhttps://hbr.org/2013/12/our-dangerous-obsession-with-external-recognition/\nhttp://ppss.kr/archives/37502\n\nㅍㅍㅅㅅ 에서는 그림과 함께 정리.','','3.5/5',0,0,0),(100000000,'http://newspeppermint.com/2014/02/26/trolling/','2015-05-14 10:22:38','2015-05-14 10:22:38','[정치/사회/경제]--심리','News Peppermint - 인터넷 트롤은 현실에서도 트롤이다, 2014-02-27, by veritaholic','#원문\nhttp://www.theguardian.com/science/head-quarters/2014/feb/25/internet-trolls-are-also-real-life-trolls\nThe Guardian - Internet trolls are also real-life trolls, 2014-02-25, by Jordan Gaines Lewis\n\n#요약\n\"“어둠의 4요소(Dark Tetrad of personality)”인 자아도취(narcissism), 권모술수(Machiavellianism), 사이코패스(psychopathy), 사디즘(sadism)을 측정\"\n\"트롤링은 다른 이를 괴롭힘으로써 즐거움을 얻는 “사디즘”과 큰 관계가 있었고, “권모술수”와 “사이코패스”와도 관계가 있었습니다. 이들의 대답을 통계적으로 분석한 결과 트롤링에 가장 핵심적인 요소는 이들의 사디즘인 것으로 드러났습니다. 즉, 이들은 남을 괴롭히기 위해 트롤링을 하는 것입니다.\"','','4.1/5',0,0,0),(100000000,'http://newspeppermint.com/2014/02/27/teenstweetaddiction/','2015-05-04 05:26:52','2015-05-04 05:34:06','[Recoeve]--심리/경향;[정치/사회/경제]--IT 시대','News Peppermint - 왜 청소년들은 유명인들의 트위터 계정에 중독되는가?','청소년기에는 소속감을 원합니다. 청소년기 주요 소속감은 학교 생활을 통해서 형성되지만 인터넷은 청소년들이 소속감을 느낄 수 있는 새로운 기반을 제공하고 있습니다. 즉 온라인에서 스타의 팬 클럽을 형성해서 비슷한 생각을 가진 사람들끼리 생각을 나누고 연대감을 느끼는 것입니다.','뭐 크게 걱정할 거리는 아닌듯. 같은 팬클럽인 애들끼리 친하게 지내고... 뭐 건강한 팬 문화가 꽤나 자리 잡은거 같아서?\n스타가 팬들 언능 공부하라고 타이르기도 하고 말이지ㅋ.','4.0/5',0,0,0),(100000000,'http://newspeppermint.com/2014/04/21/disaster-2/','2015-05-02 17:21:03','2015-05-02 17:21:03','[정치/사회/경제]--사건사고','News Peppermint - 자연재해의 심리학','극한 사건은 어떻게 우리에게 다가오는가\n인재와 자연재해\n생존자들이 겪는 세계관의 파괴\n어떻게 치료할 것인가\n긍정적인 의미를 창조하기\n\n#원문\nPsychology Today - The Psychology of Super Storm Sandy, Psychological Damage and Recovery in the Wake of a Natural Disaster, 2012-11-01, by Melanie Greenberg, Ph.D. in The Mindful Self-Express\nhttps://www.psychologytoday.com/blog/the-mindful-self-express/201211/the-psychology-super-storm-sandy\n\n#at 2014-04-21\n#요약/번역 by veritaholic','','3.6/5',0,0,0),(100000000,'http://newspeppermint.com/2014/06/17/sociopaths/','2015-05-14 10:19:39','2015-06-15 10:45:54','[정치/사회/경제]--심리','소시오패스(Sociopaths) 판별법','#related\nhttp://www.forbes.com/sites/brettarends/2014/06/16/is-there-a-sociopath-in-your-office/?utm_campaign=forbestwittersf&utm_source=twitter&utm_medium=social\nforbes.com - Help! My Co-Worker Is A Sociopath!, 2014-06-16, by Brett Arends','','3.9/5',0,0,0),(100000000,'http://newspeppermint.com/2014/12/21/m-physics/','2015-05-06 02:44:12','2015-12-11 06:59:19','[Physics/Math/Science]--Physics--Quantum Mechanics','News Peppermint - 증명할 수 없는 이론들: 끈이론과 다중우주론','#at 2014-12-22\n#by veritaholic\n#원문\nNature - News - Scientific method: Defend the integrity of physics, 2014-12-16 , by George Ellis & Joe Silk\nAttempts to exempt speculative theories of the Universe from experimental verification undermine science, argue George Ellis and Joe Silk.\n\n#related\nhttp://www.nature.com/news/scientific-method-defend-the-integrity-of-physics-1.16535\nhttp://m.todayhumor.co.kr/view.php?table=science&no=44459','','4.5/5',0,0,0),(100000000,'http://newspeppermint.com/2015/04/02/why-idiots-win-elections/','2015-12-02 08:26:11','2015-12-02 08:27:07','[정치/사회/경제]--사회','심리학과 민주주의: 왜 자꾸 바보들이 선거에서 승리할까?','','\"민주주의에서 국민은 항상 그들의 수준에 맞는 정부를 가진다.\" 란 이야기? 이 저자는 다수의 사람들 수준이 낮다고 생각하고 그 이유를 써놓은듯한???ㅋ\n\n뭔가 방법을 찾겠지... 이런걸 극복할? =ㅇ=\n\n댓글도 읽어볼만 ::\n\n더닝 크루거 효과(Dunning–Kruger effect) : 능력이 없는 사람이 잘못된 결정을 내려 잘못된 결론에 도달하지만, 능력이 없기 때문에 자신의 실수를 알아차리지 못한다. 그로 인해 능력이 없는 사람은 환영적 우월감으로 자신의 실력을 실제보다 높게 평균 이상으로 평가하는 반면, 능력이 있는 사람은 자신의 실력을 과소 평가하여 환영적 열등감을 가지게 된다. 크루거와 더닝은 “능력이 없는 사람의 착오는 자신에 대한 오해에서 기인한 반면, 능력이 있는 사람의 착오는 다른 사람에 대한 오해에서 기인한다”고 결론을 내린다.\n출처 : https://ko.wikipedia.org/wiki/%EB%8D%94%EB%8B%9D_%ED%81%AC%EB%A3%A8%EA%B1%B0_%ED%9A%A8%EA%B3%BC','8.0/10',0,0,0),(100000000,'http://newspeppermint.com/2015/04/26/busyness-in-life/','2015-05-04 18:44:13','2015-05-05 02:11:05','[정치/사회/경제]--경제','News Peppermint - 사람들이 “바쁘다”는 말을 입에 달고 사는 진정한 이유','어쩌면, 생존의 문제 앞에 우리에게는 딱히, 온 시간을 쏟아부어 매달려야 하는 ‘일’에 보다 큰 가치를 부여하는 것 외에 다른 도리가 없는지도 모릅니다.','인구수가 계속 증가해서 그런듯도... 한정된 자원을 나눠써야 하니, 서로간의 생존 경쟁이 치열해져서 그런거 아닐지. 우선 생존을 이어가려면 기본적인 의식주를 해결해야 할텐데, 인구수가 증가하면 이 경쟁이 치열해질수밖에 없으니까.\n(인간적(?)으로만 경제를 바라볼수는 없는듯. 이런 문제의 해결책은 항상 전쟁이었던듯도 하고...)','4.0/5',0,0,0),(100000000,'http://newspeppermint.com/2015/04/29/m-meme1/','2015-05-04 13:16:59','2015-05-04 13:16:59','[Recoeve]--심리/경향;[정치/사회/경제]--IT 시대','News Peppermint - 밈(Meme) 개념의 변화','#related\nhttp://newspeppermint.com/2015/04/29/m-meme2/\n\n#desc\n밈(meme)은 리처드 도킨스가 자신의 대표작 “이기적 유전자”에서 만들어낸 단어로, 인간의 여러 특성을 설명하는 물리적 복제자인 유전자(gene)에 대응해 문화적으로 전파되는 복제자를 일컫는 개념입니다. 그러나 학계에서 이 개념은 살아남지 못했고, 오히려 오늘날 인터넷 공간에서 바이럴(viral)의 의미로 쓰이게 되었고 커다란 산업으로 발전했습니다.','DNA or RNA 등에 물리적/분자적 형태로 세겨져서 후대에 전달되는 특징들/형질들을 gene (유전자, 특정 순서로 배열된 분자 뭉텅이?) 라고 하는거고. 부모가 자식에게 가르치는 생각들, 기술들, 언어들, 습관들, 즉 생각이 전염(?)되어 전파되는 것을 meme (memory? 특정 생각의 뭉텅이?) 라고 부른다는듯?\n\n같은 유전자를 가지고 태어난 생명체라 하더라도, 딱 태어나자마자 고립되어서 자라난 생명체와 부모에게서 뭔가 배우면서 (특히나 지적 생명체의 경우 언어나 문화를 배우면서) 자랐을때 후세에 전달되어 살아남고, 번식/번영하는 생명체/생각들이 달라진다는 이야기?\n\n그러고 보니 지식같은게 후세에 전달된다는게 유전자가 자연선택되어서 살아남고 자기복제 되어서 전달되는 것과 비슷한 면도 있는듯? 신기하네.','4.5/5',0,0,0),(100000000,'http://newspeppermint.com/2015/05/03/distraction-as-a-obesity/','2015-05-04 07:32:50','2015-05-04 07:35:47','[Recoeve]--심리/경향;[정치/사회/경제]--IT 시대','News Peppermint - 정보의 과잉은 마음의 비만을 부릅니다','#원문\nhttp://www.theguardian.com/media/2015/apr/12/matthew-crawford-distraction-is-a-kind-of-obesity-of-the-mind-the-world-beyond-your-head\n\n식품공학자가 지방과 소금과 설탕을 적절히 섞어 미각을 자극하는 가공식품을 만들어내는 것처럼 미디어도 우리 정신이 쉽사리 저항할 수 없는 자극물을 만들어내는 데 전문가나 다름없습니다. 과다한 자극은 마음의 비만을 부르며, 이는 실제 비만 못지않게 우리에게 해롭습니다.','정보 과잉 시대에 살고 있음. 앞으로는 더 심해질지도 모르고... 내가 Recoeve.net 을 만드는 이유이기도. 정보 과잉 시대에서 본인에게 중요한 것에 우선순위를 두고 slow 하게 SNS (Social Network Service) 를 즐기라고. Cloud Curating 의 힘을 믿고?\n\n한참 인터넷을 안하다가 찾아와도 나에게 중요했을거 같은 컨텐츠들을 예상되는 나의 중요도 순으로 추천받을 수 있게.\n\n제대로 의도한 서비스를 제공하려면 Abusing 계정들, Bot 계정들을 잘 막긴 해야할듯.\n\n아무튼 가끔은 아예 인터넷을 끊고 생활하는 것도 마음의 평화에 좋은듯 함.','4.0/5',0,0,0),(100000000,'http://newspeppermint.com/2015/05/05/conformity/','2015-05-06 09:29:30','2017-01-23 11:05:46','[Recoeve]--심리/경향','News Peppermint - 동조(conformity) 효과는 사회적 현상이 아닐 수도 있습니다','실험\n\n먼저 여성 참여자들은 220장의 여자 얼굴 사진이 얼마나 매력적인지 평가했습니다. 1부터 8까지의 숫자 버튼을 눌러 응답하는 동안 실험과 상관없는 정보가 화면에 등장했습니다. 다른 사람의 손이 숫자 버튼을 누르는 영상이었는데, 숫자는 참여자가 누르는 숫자와 같거나, 낮거나, 혹은 높았습니다. 이후 두 번째 실험에서 다시 한 번 평가가 이루어졌습니다.\n\n영상에 등장하는 손은 참여자를 헷갈리게 하기 위할 목적으로 무작위로 버튼을 누른다고 설명했음에도, 참여자들은 비디오에서 본 숫자대로 얼굴의 매력도를 평가하는 경향을 보였습니다. 이러한 동조 효과는 특히 직접 손이 화면에 등장하여 의사결정을 할 때 강하게 나타났으며, 숫자만 나타났을 때는 상대적으로 약했습니다. 심지어 화면에 나타나는 숫자가 다른 참여자의 의사결정을 반영한다고 설명했을 때도, 동조 효과는 손이 화면에 나타났을 때에 비해서는 여전히 약했습니다.\n\n동조 현상이 오직 사회적 맥락 안에서만 설명되지 않을 수도 있다는 사실을 보여줍니다. 동조 현상의 바탕에 깔린 메커니즘은 비사회적 정보에 의해 활성화될 수도 있습니다.','신기하네. URI 별로 점수 statistics 를 보여지게 만들수도 있긴한데... 좀 생각해봐야 할듯? 바로 보여주지 말고, 점수를 입력하고 나서 보여준다던지. 보려면 클릭을 눌러야만 한다던지 식으로..\n\n미리 stat 및 당신의 예상 points 등을 보여주면 이거에 영향을 받아서 points 가 달라질 수 있을듯.\n\n각 카테고리 별로 자신의 별점 stat 을 보여주는건 좋을듯? 적절하게 points 를 분배해서 recoeve 의 기능들을 더 잘 활용할 수 있는 방향으로 점수를 저장해 놓도록.','4.5/5',0,0,0),(100000000,'http://newspeppermint.com/2015/05/05/mobility-2/','2015-05-06 09:44:36','2015-06-14 11:58:55','[정치/사회/경제]--사회','주거 지역이 가난한 아이의 계층 이동에 미치는 영향','#related\nhttp://newspeppermint.com/2015/05/05/mobility2/\n\n#\n논문의 결과는 분명했습니다. 더 나은 주거 환경으로 자녀가 어릴 때 이사를 한 저소득층 가족일수록 아이의 경제적 성공 확률은 높아졌습니다. 하지만 23세 이후에 더 나은 지역으로 이주한 경우는 주거 지역이 경제적 성공에 아무런 영향을 미치지 않았습니다. 이는 단순히 좋은 주거 지역에 사는 것이 중요한 것이 아니라 유년 시절에 얼마나 좋은 주거 지역에서 거주했는지의 경험이 중요하다는 뜻이기도 합니다.','읽고 싶은데 너무 긴거 같아서(?) 길진 않은데, 당장은 귀찮아서, 천천히 읽으려고 임시 저장.','4.1/5',0,0,0),(100000000,'http://newspeppermint.com/2015/05/06/gene-matters/','2015-05-17 22:39:51','2015-05-17 22:40:10','[음식/요리/건강]--건강','매일 운동을 해도 운동 능력이 떨어진다면?','\"그는 이 새로운 연구의 잠재적 교훈은, ‘우리는 운동을 할 때, 우리 몸의 운동에 대한 반응을 면밀히 관찰해야 한다는 것’이라고 말했습니다. 만약 수개월에 걸친 운동에도 불구하고 어떤 사람이 운동을 시작하기 전에 비해 큰 발전이 없다는 것을 발견할 경우, 운동의 강도나 빈도 등을 변화시키거나, 웨이트 트레이닝과 같은 다른 운동을 하는 것을 고려해봐야 한다는 것입니다. 근력운동에 관여하는 유전자들은 유산소운동에 반응하는 유전자들과 매우 다를 가능성이 높기 때문입니다.\"','실험이나 결론이 뭔가... 그닥 엄밀하게 진행된건 아닌듯. 왜 심장 근육에 집중을 하지? 심장에 딱 국한된 거라기 보단, 몸 전체 근육이 잘 발달하는 DNA 가 있을테고, 근육이 잘 발달하지 못하는 DNA 가 있는거 아녀?\n\n아무튼 결론은 읽어볼만 하니까.','2.4/5',0,0,0),(100000000,'http://newspeppermint.com/2015/05/07/exercise-2/','2015-05-07 23:41:25','2015-05-08 16:24:33','[음식/요리/건강]--건강','운동, 얼마나 하는 게 가장 좋을까?','“몸을 움직이는 데 큰 제한이 없는 사람들이라면, 일주일에 150분은 꼭 운동하는 데 쓰도록 신경쓰는 게 좋습니다. 그 150분 가운데 약 20~30분은 다소 격렬한 운동을 해도 좋을 겁니다. 그보다 더 몸을 움직이고 싶으시다고요? 그렇게 하세요. 우리 연구 결과를 토대로 한다면, 운동 많이 한다고 해가 될 일은 없었으니까요.” (New York Times)','','5.0/5',0,0,0),(100000000,'http://newspeppermint.com/2015/05/07/m-interrogation/','2015-05-20 18:08:12','2015-05-20 18:08:12','[정치/사회/경제]--심리','윤리적으로 자백을 받아내는 법','관계를 형성하라. 이는 잘 알려진 “좋은 경찰” 전략입니다. 심문자가 냉정한, 이것 저것 따지는 스타일일 때보다 상대방에게 더 공감하는 스타일일 때 이들이 더 많은 것을 털어놓는다는 사실은 잘 알려져 있습니다. 연구팀이 제시한 다른 많은 방법들 역시 먼저 상대를 협조적으로 만들어야 한다는 사실을 강조하고 있습니다. “관계를 형성하는 것은 가장 먼저 해야하는 일입니다. 상대를 협조적으로 만든 다음에야, 우리는 ‘내가 원하는 정보를 어떻게 끌어낼 것인가’를 생각할 수 있습니다.”\n\n빈칸을 채우게 하라. 알아내야 할 사실을 직접 묻는 것 보다는 상대방에게 마치 당신이 한 일들을 알고 있다는 듯이 전체 사건을 들려주는 것이 더 좋습니다. 이야기가 진행되는 동안 상대방은 세부적인 내용을 덧붙이거나 어떤 부분을 수정할 겁니다. 이 기술은 2차대전 당시 이를 개발한 독일의 한스 샤프의 이름을 따 샤프(Scharff) 테크닉이라 불립니다. 최근 한 연구는 이 기술이 직접적인 질문보다 더 많은 정보를 이끌어낸다는 것을 보였습니다. 이를 실제로 사용하는 이들 역시 이 기술의 효과를 과소평가하는 경향이 있습니다.\n\n놀라게 하라. 심문을 받는 사람은 자신이 의심받고 있다는 사실을 알고 있으며, 이 때문에 대답을 미리 준비하는 경향이 있습니다. 위증자는 자신의 이야기를 진실처럼 보이게 해야 하며 동시에 침착하고 냉정해 보여야 하므로 커다란 인지적 스트레스를 받게 됩니다. 예상치 못한 질문을 함으로써 이들이 스스로 허점을 보이게 만들 수 있습니다.\n\n이야기를 거슬러 올라가라. 보통 사람들의 생각과는 다르게, 거짓말을 하는 사람은 자신의 이야기를 바꾸지 않는 반면, 진실을 이야기하는 사람들이 내용을 고치고 세부를 덧붙이는 경향이 있습니다. 마이스너는 “모순은 기억이 가진 근본적인 특성 중 하나입니다”라고 말합니다. 이런 특징을 이용하기 위해 심문자는 종종 사람들에게 사건을 시간의 역순으로 회상할 것을 요구합니다. 이는 두 가지 효과가 있습니다. 곧, 진실을 말하는 사람들은 이를 통해 더 많은 기억을 되살릴 수 있으며 거짓을 말하는 이들은 사건을 꾸미기가 더 어려워집니다.\n\n결정적 순간까지 증거를 감추어라. 지난 3월에 발표된 연구는 사람들이 자신을 추궁하는 증거에 직면하게 될 경우, 사람에 따라 입을 닫거나, 심문자에게 적대적으로 바뀌거나, 분노를 드러내게 된다는 것을 보였습니다. 이를 피하기 위해서는 증거를 직접 제시하기보다 가볍게 암시하는 방법을 택해야 합니다.','','4.6/5',0,0,0),(100000000,'http://newspeppermint.com/2015/06/02/working-together/','2015-06-03 03:20:26','2015-06-03 03:20:36','[Recoeve]--경영;Later','News Peppermint - 사람을 대하는 게 익숙치 않은 사람들과 함께 일하는 법','','',NULL,0,0,0),(100000000,'http://newspeppermint.com/2015/06/08/m-scientist1/','2015-06-09 05:30:38','2015-06-09 15:13:10','[Physics/Math/Science]','[필립 볼 칼럼] 더 나은 과학을 만드는 법','#related\nhttp://newspeppermint.com/2015/06/08/m-scientist2/\n\n#\n버지니아 대학의 심리학자 브라이언 노섹은 과학계에서 가장 흔한 편향으로 관찰결과를 특정한 이론에 맞게 해석하는 “동기에 바탕한 추론(motivated reasoning)”을 꼽았습니다. 그는 인간의 대부분의 생각이 실은 합리화(rationalization)에 불과하다고 말합니다. 이는 곧, 인간은 이미 하고 싶은 일에 대해 결정을 내린 뒤, 그 결정을 정당화하기위한 설명을 찾는다는 뜻입니다. 물론 과학은 이런 일반적인 사고과정에 비해 더 객관적이고 회의적이어야 합니다. 문제는 과학이 실제로 얼마나 더 객관적인가 하는 것입니다.','','4.8/5',0,0,0),(100000000,'http://newspeppermint.com/2015/06/21/startup-worst-things/','2015-06-22 02:27:47','2015-06-22 02:29:34','[Recoeve]--경영','스타트업을 시작하려는 당신에게 아무도 말해주지 않는 아홉 가지','일은 넘쳐나는데 맡아서 할 사람은 없습니다.\n\n정말 흥미가 가는 일에 푹 빠져들 시간이 없습니다.\n\n매사 99퍼센트의 확률로 틀립니다.\n\n틀림없이 많은 돈을 벌진 못할 겁니다.\n\n업무체계는 중구난방이고 설립자는 지나치게 큰 권력을 누립니다.\n\n불확실성을 감내할 수 있나요?\n\n실패하리라는 두려움을 감당할 수 있나요?\n\n가르침은 거의 주어지지 않을 뿐더러 길을 잃기는 너무나 쉽습니다.\n\n스타트업은 끊임없는 롤러코스터 타기입니다.','','6.0/10',0,0,0),(100000000,'http://newspeppermint.com/2015/08/31/m-spookiness/','2016-12-21 11:40:51','2016-12-21 11:40:51','[Physics/Math/Science]--Physics--Quantum Mechanics','다시 한 번 확인된 양자역학의 승리, 아인슈타인의 패배','','','9.2/10',0,0,0),(100000000,'http://newspeppermint.com/2016/03/13/m-doping/','2016-03-15 11:18:38','2016-03-15 11:19:04','[정치/사회/경제]--심리;[Physics/Math/Science]--뇌과학','운동선수의 능력을 강화하는 ‘브레인 도핑’','','','8.7/10',0,0,0),(100000000,'http://newspeppermint.com/2016/03/14/m-ego1/','2016-03-15 11:12:46','2016-03-17 23:55:35','[정치/사회/경제]--심리;[Physics/Math/Science]--뇌과학','‘의지력의 고갈’이 사실이