n - pierre.io :: Pierre Nel','','본인이 했던 Project 들 나열.','7.0/10',0,0,0),(100000000,'http://plug.hani.co.kr/data/2267087','2015-06-17 10:22:36','2015-06-17 10:22:36','[정치/사회/경제]--사건사고--2015-05 메르스','한눈에 보는 메르스 확진자 현황(2)','','그래프적으로 잘 정리되어 있는듯.','9.2/10',0,0,0),(100000000,'http://portal.wecreatestuff.com/portal.php','2017-02-07 04:46:45','2017-02-07 04:46:45','[Music/Break]--게임','portal','','','9.1/10',0,0,0),(100000000,'http://ppss.kr/','2015-05-04 05:38:04','2015-05-04 05:38:04','[정치/사회/경제]','ㅍㅍㅅㅅ ppss.kr','폭풍시사?','폭풍시사란 뜻인가? 가끔 재밌는 글들이 올라오는듯. 그런데 대부분 어느 블로그에 올라오는 글들 긁어오는듯한 느낌이? 뭐 허락받고 옮기는 것이겠지만.','3.4/5',0,0,0),(100000000,'http://ppss.kr/archives/57369','2015-09-30 17:51:23','2015-10-03 12:59:17','[Recoeve]--경영','구글을 때려치우고 스타트업을 엑시트 하기까지 얻은 교훈 by 이승환, 서승환','','현실적인 스타트업 이야기인듯... 애초에 투자받기도 힘들고, 투자 받더라도 성공하기는 더 힘든? 난 될라나? =ㅇ=;;;','8.1/10',0,0,0),(100000000,'http://ppss.kr/archives/57681','2015-10-02 09:17:01','2015-10-02 09:25:30','[정치/사회/경제]--경제','헬조선에 살아도, 괜찮아','','\"내 멀쩡한 삶을 실패한 것으로 만들지 말아주셨으면 좋겠다. 좋은 직업이 곧 성공의 기준인 것처럼 말하지 말았으면 좋겠다. 한 달에 버는 돈을 삶의 질과 행복의 척도로 만들지 말았으면 좋겠다. 월세집에 사는 것을 실패의 기준으로 여기지 말았으면 좋겠다. 결혼하지 않는 것을 패자의 낙인처럼 여기지 말았으면 좋겠다.\"\n\n와닿네... 후... 이런건 뭔가 해결 방법 찾기가 너무 힘든. 풍요로워지면 자식들을 많이 낳고, 그러다가 어려워지면 남의것을 빼앗아야 하니 전쟁이 일어나고... 이런게 역사 같아서 ㅡㅡ. 그렇다고 억지로 산아제한을 하는것도 부자들만 자식 낳으라는 식 같기도 하고;;; 뭔가 모두가 만족할만한 그런것들, 그것도 몇세대 이상 지속 가능할만한 것들은 없는거 같기도...\n\n제한된 물질들을 가질 권리를 사회적으로 누구에게 줄 지... 경쟁에서 진 사람들, 능력은 많아도 부모나 환경이 받쳐주지 못하는 사람들은 어떻게 대해야 할지... (지금은 실패한 사람은 방치하고, 능력은 많지만 환경이 받쳐주지 못하는 사람들은 이미 성공한 사람들이 저임금으로 고용해서 부려먹는 식인거 같으니... 아니면 아예 기회조차 없거나.) 어렵다. 내 처지도 뭐 그게 그거고... 상위 1% 아니면 다 거기서 거기일거 같긴 하지만... 상위 1% 에서도 또 상위 0.1% 는 또다른 세상인거 같고... (뭐 이런 집안에서 태어났어도 본인 능력이 하위 50%이면 음울하긴 하겠지만.)\n\n뭔가 능력에 따라 사회적 대우가 정해지는 세상도 유토피아처럼 보이지 않긴 한데... 그런 사회에서 장애인, 혹은 사회에서 경쟁력 없는 사람으로 태어났다면 정말 절망일거 아냐?? 아 어렵다 어려워...\n\n의료기술의 발달 + 전쟁기술의 발달(?)로 쉽게 죽지도 못하니... 안락사가 답이여? ㅡㅡ. 요새 왜 자꾸 이런 무서운 생각도 드는지 에휴... 실패한 사람은 어느시점에선 빠르게 죽음을 택하는게 본인을 위해서도, 사회를 위해서도 좋은 방법 같기도 하도. 음울한 세상이고 현실이다.\n\n나조차도 이기심을 잘 버리지 못하겠는데, 과연 이 사회의 대다수 사람들이 자신의 이익들, 가진것들, 가지고 싶은 것들을 어느정도 포기하면서 여유롭게, 배려하면서 살 수 있을지;;;\n\n\"전세계 인구수가 너무 증가하면 우리 모두가 힘들테니 적당히만 아이를 가지자.\", \"환경오염, 자연파괴, 한정된 자원 등, 후손들을 위해서 지금 조금 불편하더라도 이것저것 잘 아끼면서 살자.\" 등 과연 이런것들이 먹힐까? 지금도 경제성장, 경제성장하면서 더 많은걸 소비하고 누리면서 살고 싶어하는 사람들이 대다수인데? 나 또한 그러하기도 (매일 따뜻한 물에 샤워하고, 매일 맛있는 것들 먹고싶고, 넓은 집/공간을 차지하고 싶고 등) 하고... 후... 어려워 ㅠㅜ','9.0/10',0,0,0),(100000000,'http://ppss.kr/archives/63540','2015-12-09 08:56:28','2015-12-11 07:00:56','[Physics/Math/Science]--Physics--Quantum Mechanics;[Physics/Math/Science]--뇌과학','ㅍㅍㅅㅅ - 고양이는 어떻게 평생을 집안에서만 살 수 있을까?','','물리 카테고리에 이 글을 넣어놓은건 \"인간의 시간 인식을 관장하는 신피질\", \"신피질이 없는 고양이에겐 현재뿐이다\" 란 문장들 때문...ㅋ\n\n뇌란게 양자역학 측정문제랑도 관련된거 같기도 하고... 슈뢰딩거의 고양이도 생각나서? =ㅇ=;; 시간의 mystery 랑도 살짝쿵 연관성이 있고.','7.8/10',0,0,0),(100000000,'http://ppss.kr/archives/63881','2015-12-15 02:18:15','2015-12-15 02:18:43','[IT/Programming]--자기계발;[Recoeve]--경영','프로그래머의 경력을 말아먹는 12가지 방법','','','9.6/10',0,0,0),(100000000,'http://proceedings.mlr.press/v37/jozefowicz15.pdf','2017-09-14 02:33:15','2017-09-14 06:17:19','[IT/Programming]--기계학습;[IT/Programming]--기계학습--RNN','An Empirical Exploration of Recurrent Network Architectures.pdf','','',NULL,0,0,0),(100000000,'http://racksburg.com/choosing-an-http-status-code/','2015-12-14 23:12:01','2015-12-14 23:12:01','[IT/Programming]--HTTP','Choosing an HTTP Status Code — Stop Making It Hard','','404 만 알면 되지 않을까나?ㅋ','9.2/10',0,0,0),(100000000,'http://radio.kbs.co.kr/player/openk/player.php?url=/bora/20150531kpop_2.mp4&title=&no_logon=1&type=906&kind=vod','2015-06-03 10:46:14','2015-07-01 09:52:02','[Music/Break]--KARA--예능','KBS K-Pop Planet 직캠/보이는 라디오','','',NULL,0,0,0),(100000000,'http://recoeve.net/','2015-05-06 02:23:35','2015-05-06 02:24:02','[Recoeve]','Recoeve.net','','아직은 허접한 단계니까 내가 만들었어도 내 점수가 짜다ㅋ.','3.0/5',0,0,0),(100000000,'http://recoeve.net/user/kipacti','2015-05-06 05:32:44','2015-05-06 05:34:57','[Bookmarks]--Friends in Recoeve','kipacti on Recoeve.net','','내 second 계정.',NULL,0,0,0),(100000000,'http://recoev