0000,'http://scienceon.hani.co.kr/113775','2015-11-21 12:14:15','2015-11-21 12:14:15','[Physics/Math/Science]--Physics--Quantum Computer','‘최초의 상업용 양자컴퓨터’ 어떻게 볼 것인가?','','\"양자 어닐링 (quantum annealing) 은 난해한 최적화 문제를 해결하는 데 쓰는 일반 전략이다.\" 라는걸로 봐서 구글이나 나사가 이 컴퓨터를 왜 구입했는지 대충 감이? 최적화 문제 푸는게 Machine Learning 하고도 관계가 깊어서... 아마도 여기에 활용하려고 한듯? 그런데 과연 얼마나 도움이 됐을라나? 초기단계라 거의 뭐 연구용으로 산듯하긴 함. 양자 컴퓨터가 얼마나 강력하고, 어떤 문제들을 풀 수 있고 뭐 이런거에 대한 감을 잡으려고 한듯?','7.5/10',0,0,0),(100000000,'http://scienceon.hani.co.kr/118328','2015-05-02 03:40:58','2015-05-02 15:54:52','[Physics/Math/Science]--뇌과학','사이언스온 - 기억의 불완전함: 내 기억은 얼마나 진짜 기억일까?','기억의 이면 - 거짓기억, 조작기억\n기억을 심을 수 있을까?\n억압된 기억을 찾아라!\n신경세포 자극해 과거 기억 떠올리게\n신경세포 조작으로 만든 거짓 기억\n내 기억은 얼마나 진짜 기억일까?\n\n#by 홍수 / 카이스트 바이오및뇌공학과 박사과정\n#at 2013. 08. 23','신기한 뇌.\n결론은 우리의 기억은 그렇게 정확하지 않으니 자신의 기억에 대해 어느정도 비판적인 입장을 가지고, 추가로 중요한 기억들은 따로 잘 기록하는 습관을 기릅시다? 가 될라나?\n사진이나 문서 정리를 잘 합시다. Recoeve 도 잘 활용하면서? =ㅇ=','4.0/5',0,0,0),(100000000,'http://scienceon.hani.co.kr/172563','2015-11-21 11:47:34','2015-11-21 11:47:34','[Physics/Math/Science]--Physics--Quantum Computer','\'최초 상업용 양자컴퓨터\' 성능평가 갑론을박','','','6.9/10',0,0,0),(100000000,'http://scienceon.hani.co.kr/174124','2015-11-21 10:26:21','2015-11-21 10:28:21','[Physics/Math/Science]--Physics--Quantum Computer','scienceon.hani - \"꿈의 양자컴 맞나\" 학계는 \'철저검증\' 분위기','이순칠 교수의 \'2014 미국물리학회\' 참가기\n\n※ 이 글은 이순칠 카이스트 교수(물리학)의 미국물리학회 참가기입니다. 미국물리학회의 양자 컴퓨터 세션에서 주요 관심사 중 하나였던 ‘디-웨이브’ 컴퓨터와 관련한 발표를 보고 듣고 느낀 점을 이 교수가 정리해 한겨레 사이언스온에 보내주셨습니다. 최근 ‘최초의 상업용 양자 컴퓨터’를 표방한 디-웨이브 컴퓨터의 성능과 관련한 연구논문이 발표되고 관련 뉴스가 보도되었던 터라, 이 분야에 관심 있는 독자들한테는 학계의 분위기를 이해하는 데 유익한 글이 될 듯하여, 이 교수의 글을 이곳에 싣습니다. -사이언스온','양자 컴퓨터 원리가 뭐지? 아직 이걸 잘 모르겄음;;;\n말들은 참 많은데, 내가 머리가 나빠서 이해를 못하는건지, 설명하는 사람이 설명을 잘 못하는건지, 아님 너무 어려워서 그런건지, 불가능한걸 가능하다고 뻥친건지... 도통 모르겄네;;;\n\n계속 이것저것 찾아보면서 공부하다보면 알게 되려나? =ㅇ=\n\n아무튼 이 기사는 양자컴퓨터 개발에 성공했다는 회사들, 연구진들에 대해 불신이 있다는 이야기인듯.','8.8/10',0,0,0),(100000000,'http://scienceon.hani.co.kr/media/277367','2015-11-21 12:16:15','2015-11-21 12:16:15','Later','중력