e.tistory.com/725','2015-12-12 12:32:40','2015-12-12 12:32:40','[Physics/Math/Science]','송유근 표절, 자신에게 연구능력이 있는지 판단하는 법.','','','6.8/10',0,0,0),(100000000,'http://sovidence.tistory.com/726','2015-12-08 06:49:13','2015-12-08 06:49:13','[정치/사회/경제]--경제','핀란드, 모든 국민에게 월 100만 원 지급하는 ‘기본소득’ 구상 중','기본소득은 다른 사회보장 제도를 대체하게 될 예정. 이는 기본소득으로 다른 사회보장제도를 폐지하자는 과거 프리드만등 우파의 생각과 동일.\n\n현 시점에서 기본소득이 다시 각광받는 이유는 자동화 기계화 경제발전 둔화 등으로 인해 노동유인 정책으로 삶의 질을 보장하기 어렵게되고 있기 때문. 노동 공급이 문제가 아니라 일자리 자체가 없다는 것. 앞으로 로봇이 나오면 일자리는 더욱 줄어들 것. 노동시장에 참여할 수 없는 계층의 수가 상당히 커진 것. 좌파적 입장에서 이들을 돌보는 프로그램이 필요함.\n\n다른 한편으로는 저숙련 노동자들은 일해봤자 경제에 별로 도움이 되지도 않음. 차라리 기본소득을 주고 정치적 안정을 이룩하여 잘나가는 고숙련 기술자, 고학력 노동자들 끼리 경제를 이끌어가는게 나을 것이라는 생각이 등장하고 있음. 이게 우파의 생각.\n\n#related\nhttp://ppss.kr/archives/61127','신기한 정책 실험.','8.9/10',0,0,0),(100000000,'http://sp.universal-music.co.jp/kara/fit/','2015-06-03 09:52:15','2015-07-01 10:01:39','[Music/Break]--KARA--Links','KARA Fit','','',NULL,0,0,0),(100000000,'http://stat.seoul.go.kr/inter/ko/price/index.html','2015-07-03 00:07:43','2015-07-03 00:09:59','[정치/사회/경제]--정치','서울시 물가 통계','','알아먹기 힘들게 되어 있는거 같기도...\n버튼 몇개 눌러보다 보면 알아먹게 되긴 함.','8.3/10',0,0,0),(100000000,'http://stat.seoul.go.kr/inter/ko/tax/index.html','2015-07-03 00:06:53','2015-07-03 00:06:53','[정치/사회/경제]--정치','서울시 재정시계','','좀 더 깔끔해졌으면 하지만? 시도 자체는 멋진듯.\n역시나 투명성 올리는게 반부패 대응법으로는 짱이신듯.\n하지만 부패잔치 벌이고 싶은놈 집권하면 이딴거 (힘겹게 세금들이고 만들어 놓은 시스템) 또 다시 다 버리겠지?ㅋㅋ','9.1/10',0,0,0),(100000000,'http://storefarm.naver.com/sbhcfood/products/604361344','2017-02-09 03:54:40','2017-02-09 03:54:40','[음식/요리/건강]--음식','세방 황칠 순살(무뼈)족발 400g 내외','','한번 시켜봐야지. 인터넷에서 평이 좋았음. 네이버 페이도 사용해볼겸.',NULL,0,0,0),(100000000,'http://studio-g.tistory.com/category/KARA','2015-07-14 02:33:05','2015-07-14 02:33:05','[Music/Break]--KARA--Links','studio-g.tistory.com/category/KARA','','',NULL,0,0,0),(100000000,'http://sungmooncho.com/2015/07/01/blue-ocean/','2015-10-03 12:56:35','2015-10-03 12:56:35','[Recoeve]--경영','블루 오션은 없다 by 조성문','스타트업을 한다는 것은, 피가 튀는 전쟁터에 들어가는 것과 비슷하다. 수많은