thematics makes physics problem unanswerable','#related\nhttp://arxiv.org/abs/1502.04573 Undecidability of the Spectral Gap (full version)','우왕~! 우와왕~!!! 이건 정말 역사적인 발견일수도 있을거 같은데...ㅋ.\n\n여기저기서 검증을 받아야 겠지만, 불완전성 정리랑 물리학 이론이랑 그럴듯하게(?) 섞어서 무언가 결론을 냈다는거부터가 신선한 충격이... (개인적으론 불완전성 정리를 물리이론에 적용하면 \"우주 내부에 존재하는 지적생명체는 우주의 법칙을 완벽히 이해하거나 밝혀낼 수 없을수도 있는거 아냐?\" 요정도의 생각은 했었었는데ㅋ)\n\n그런데 읽어보니 별거 아닌거 같기도 하고... 무한대로 가면 대부분 못푸는것들이 있는거 아닌가? =ㅇ=;; 점근선조차 못알아낸다는 뜻인건가? 어렵당.','9.0/10',0,0,0),(100000000,'http://www.nature.com/nphys/journal/vaop/ncurrent/pdf/nphys3535.pdf','2015-11-21 14:49:35','2015-11-21 14:49:35','[Physics/Math/Science]--Physics--Experiment about Magnetics','Soliton-like magnetic domain wall motion induced by the interfacial Dzyaloshinskii–Moriya interaction','Soliton-like magnetic domain wall motion induced by the interfacial Dzyaloshinskii–Moriya interaction\n\nYoko Yoshimura,	Kab-Jin Kim,	Takuya Taniguchi,	Takayuki Tono,	Kohei Ueda,	Ryo Hiramatsu,	Takahiro Moriyama,	Keisuke Yamada,	Yoshinobu Nakatani	& Teruo Ono\n\nTopological defects such as magnetic solitons, vortices and skyrmions have started to play an important role in modern magnetism because of their extraordinary stability1, which can be exploited in the production of memory devices. Recently, a type of antisymmetric exchange interaction, namely the Dzyaloshinskii–Moriya interaction (DMI; refs 2,3), has been uncovered and found to influence the formation of topological defects4, 5, 6, 7. Exploring how the DMI affects the dynamics of topological defects is therefore an important task. Here we investigate the dynamics of the magnetic domain wall (DW) under a DMI by developing a real time DW detection scheme. For a weak DMI, the DW velocity increases with the external field and reaches a peak velocity at a threshold field, beyond which it abruptly decreases. For a strong DMI, on the other hand, the velocity reduction is completely suppressed and the peak velocity is maintained constant even far above the threshold field. Such a distinct trend of the velocity can be explained in terms of a magnetic soliton, the topology of which is protected during its motion. Our results therefore shed light on the physics of dynamic topological defects, which paves the way for future work in topology-based memory applications.','',NULL,0,0,0),(100000000,'http://www.naturenscience.co.kr/','2015-05-09 06:33:26','2016-06-01 08:11:27','[Physics/Math/Science]--Open Course Ware','Nature n Science .co.kr','','',NULL,0,0,0),(100000000,'http://www.nytimes.com/2015/05/10/nyregion/manicurists-in-new-york-area-are-underpaid-and-unprotected.html?_r=0','2015-05-09 02:23:12','2015-05-09 02:23:12','[정치/사회/경제]--사회','NY Times - The Price of Nice Nails','','','3.1/5',0,0,0),(100000000,'http://www.nytimes.com/2016/03/14/universal/ko/seouls-colonial-boomerang-korean.html?_r=0','2016-03-15 11:23:51','2016-03-15 11:29:47','[정치/사회/경제]--역사--대한민국','오피니언: 부메랑이 되어 돌아오는 한국의 반일 감정','','50년 가까이를 식민지배 당했으니...','7.4/10',0,0,0),(100000000,'http://www.o-bible.com/bbe.html','2019-07-24 22:12:58','2019-07-24 22:23:34','[정치/사회/경제]--종교','bible','','','5.0/10',0,0,0),(100000000,'http://www.oricon.co.jp/prof/503091/products/1123829/1/','2015-05-05 13:42:53','2015-07-01 10:01:19','[Music/Break]--KARA--Links','ORICON - サマー☆ジック/Sunshine Miracle/SUNNY DAYS(初回限定盤A)','#発売日 2015年05月05日	\n#発売元 ユニバーサル ミュージック\n#品番 UPCH-89217	\n#価格 3,132円（税込）','일본에서 인기 대단하다 정말ㅋ. 앨범 발매 첫날 오리콘 차트 1등한듯?','4.7/5',0,0,0),(100000000,'http://www.popeyes.co.kr/','2015-06-09 09:47:14','2015-06-09 09:47:14','[음식/요리/건강]--음식점 할인정보','파파이스','#related\nhttp://www.popeyes.co.kr/event/\nhttps://www.facebook.com/PopeyesKorea','',NULL,0,0,0),(100000000,'http://www.primer.kr/','2015-05-06 01:21:42','2015-05-06 01:21:42','[Recoeve]--투자','프라이머','','',NULL,0,0,0),(100000000,'http://www.primer.kr/apply/','2016-11-09 02:55:43','2016-11-09 02:56:19','[Recoeve]--투자','Primer','','\"엔턴십 11기는  2016년 12월에 모집이 시작됩니다.\" 라는데, 신청해 볼까나?',NULL,0,0,0),(100000000,'http://www.rleonardi.com/interac