get into it.\n\n#The_Missing_Link\nDiscussion and community were among the first great promises of the Internet. But before Disqus, they were neglected by the revolution in other forms of communications. So we built the leading company in a category that, in some ways, we invented. And quietly, made having an online discussion a better experience.\n\n#A_Good_Discussion_is_Great_to_Find\nWhen you visit one of the millions of sites using Disqus, you’re in a connected community, fundamentally different from a traditional destination social network. When you’re on a site using Disqus, you’re exploring a personal passion and in an optimal place to discover new ideas, new people and new stories that you couldn’t find anywhere else.\n\n#Comments_Count\nWith Disqus, publishers experience a more engaged audience that spends more time on site and consumes more content. They grow their audience by being part of a content discovery loop across the Disqus network. They can turn on a new revenue stream through native advertising. Comments no longer cost, they count.\n\n#People_Just_Want_to_Be_Heard\nToday, we represent, in our one billion monthly visitors and over 40 languages, a vital part of the way the world communicates. People no longer just want to read or share the story. They want to be in the story. Disqus will shape the future of online discussion by continually giving people better ways to participate in the communities, events and stories shaping their lives.','DISQUS 이름에서도 알 수 있듯이 토론 (DIScuss/Debate), 비난 (DISs), 질문 (QUestion), 우리들 (US) 을 도와주는 서비스.\n\n몇가지 아쉬운 점도 있긴한데, 지금까지 나온 댓글 위젯 서비스 중에서는 단연 으뜸이라고 생각함.','4.7/5',0,0,0),(100000000,'https://distill.pub/2016/augmented-rnns/','2017-09-14 02:34:03','2017-09-14 06:16:34','[IT/Programming]--기계학습;[IT/Programming]--기계학습--RNN','Distill.pub - Attention and Augmented Recurrent Neural Networks','','',NULL,0,0,0),(100000000,'https://docs.mongodb.com/manual/tutorial/install-mongodb-on-os-x/','2017-07-20 04:42:30','2017-07-21 02:12: