 물질을 없앤다. 염증이 덜 생기면 염증과 싸우기 위한 에너지를 절약할 수 있어 피로도가 준다. 운동은 1주일에 서너 번, 오전이나 오후에 한 시간씩 하는 게 적절하다. 포도, 라스베리, 크렌베리 등의 베리류를 자주 먹는 것도 도움이 된다. 베리류 안에 많은 레스베라트롤은 미토콘드리아의 기능을 활성화한다.','','8.8/10',0,0,0),(100000000,'https://opentutorials.org/course/1','2015-12-19 05:53:02','2017-08-17 01:40:45','[IT/Programming]--HTML--beginners','opentutorials.org','','초보들이 처음 html+css+javascript 배우기 좋은곳.\n쵝오.','10.0/10',0,0,0),(100000000,'https://packagecontrol.io/packages/BracketHighlighter','2015-12-14 00:30:38','2015-12-14 00:32:14','[IT/Programming]--App--Editor--Sublime Text Packages','Bracket Highlighter','','Sublime text 기본적으로도 bracket 의 highlight 는 어느정도 되는거 같은데... 밑줄정도만 쳐졌던걸로 기억. 그래서 눈에 띄지를 않음.\nBracket 이 좀 더 눈에 잘 띄도록 해줌.','9.1/10',0,0,0),(100000000,'https://packagecontrol.io/packages/ConvertToUTF8','2015-12-14 00:33:24','2015-12-14 00:33:24','[IT/Programming]--App--Editor--Sublime Text Packages','Convert To UTF8','','한글 쓰려면 필수.\nps. Encoding 은 UTF8 씁니다. 다국어 지원할때 이것만한게 없는듯.','10.0/10',0,0,0),(100000000,'https://packagecontrol.io/packages/Emmet','2015-12-14 00:33:59','2015-12-14 00:33:59','[IT/Programming]--App--Editor--Sublime Text Packages','Emmet','','HTML tag 의 자동완성.\n이거 없으면 큰일남.','10.0/10',0,0,0),(100000000,'https://packagecontrol.io/packages/Package%20Control','2015-12-14 00:27:03','2015-12-14 00:27:03','[IT/Programming]--App--Editor--Sublime Text Packages','Package Control','','가장 기본.','10.0/10',0,0,0),(100000000,'https://packagecontrol.io/packages/SideBarEnhancements','2015-12-14 00:28:55','2015-12-14 00:29:15','[IT/Programming]--App--Editor--Sublime Text Packages','Sidebar Enhancements','','딱히 이 기능을 많이 쓰진 않는듯.\n그래도 있으면 편한게 있긴 한듯.','7.9/10',0,0,0),(100000000,'https://plus.google.com/','2015-05-04 02:57:56','2015-05-04 02:57:56','[Recoeve]--참고할만한 서비스들','Google+','Google+ is a place to connect with friends and family, and explore all of your interests. Share photos, send messages, and stay in touch with the people and ...','어떤 컨셉의 SNS 인지 모르겄음;;;\n\n로그아웃해서 페이지에 접근해도 로그인 하라고만 뜨고 사이