만지지 않아야 하며, 기침할 때는 입과 코를 휴지로 가리고, 발열이나 기침이 있는 사람과는 접촉을 피하여야 합니다.\n \n6. (자가격리) 환자와 밀접한 접촉을 한 경우, 증상이 없더라도 보건소에 연락하고 가족과 주변사람을 위해 접촉일로부터 14일간 자가 격리를 해야 합니다.\n \n7. (진료) 환자와 밀접 접촉을 하였거나, 중동지역을 방문한 후 14일 이내에 메르스 의심 증상이 있으면 의사의 진료를 받아야 합니다.\n \n8. (진단) 메르스는 가래, 기관지 세척액의 유전자를 검사(RT-PCR)하여 진단합니다.\n \n9. (치료) 환자는 증상에 따른 치료를 받게 되며, 중증의 경우에는 인공호흡기, 혈액투석 등 집중 치료를 받습니다.\n  * 증상과 발열이 48시간 이상 없고, 유전자검사 결과가 24시간 간격으로 2회 음성인 경우 퇴원\n \n10. (장비) 의료진은 손씻기, 일회용 가운과 장갑, N95 마스크, 눈보호 장비를 갖추어야 합니다.','국가기관 공식 페이지.\n\n요새 정부의 신뢰도가 바닥이라 그런지 이런 공식계정, 공식 블로그들을 다들 잘 안찾아보는듯 ㅡㅡ. 그래도 정보는 언론들 (특히나 그지같은 기레기 언론 몇개사들) 보다 이쪽이 빠르고 정확할때가 많은데...','4.5/5',0,0,0),(100000000,'https://twitter.com/SkelterLabs','2017-07-18 12:40:33','2017-07-18 12:40:33','[IT/Programming]--Skelter Labs--Links','Twitter - Skelter Labs','','',NULL,0,0,0),(100000000,'https://velopert.com/reactjs-tutorials','2016-12-03 04:58:10','2016-12-03 04:58:10','[IT/Programming]--HTTP--ReactJS','velopert.com/reactjs-tutorials','','','8.6/10',0,0,0),(100000000,'https://vimeo.com/187900465','2016-11-04 07:55:47','2016-11-04 07:55:47','','','','','4.6/10',0,0,0),(100000000,'https://watcha.net/','2015-05-04 02:31:02','2015-05-04 02:31:02','[Recoeve]--참고할만한 서비스들','왓챠 (Watcha)','영화 평가 및 추천 서비스.','영화 관련해서 평가하고 그 평가 바탕으로 추천해주는 서비스.','3.0/5',0,0,0),(100000000,'https://www.coursera.org/','2015-05-09 05:06:28','2016-06-01 08:10:44','[Physics/Math/Science]--Open Course Ware','Coursera.org','','','4.9/5',0,0,0),(100000000,'https://www.dailymotion.com/video/x2vrnex','2019-03-30 02:40:23','2019-03-30 02:40:23','[Music/Break]--K-Pop;[Music/Break]--가수별--아이유','아이유 - Gee + Lies + Sorry Sorry (at 유희열의 스케치북)','','멋있는 편곡ㅋ.','8.0/10',0,0,0),(100000000,'https://www.dongascience.com/news.php?idx=55142','2022-07-06 11:43:07','2022-07-06 11:43:07','[Physics/Math/Science]--Math','[엄상일 교수가 설명하는 허준이 교수 업적] 난제인 조합수학을 대수기하학이란 도구로 해결한 아이디어맨','','','10.0/10',0,0,0),(100000000,'https://www.facebook.com/','2015-05-04 02:54:07','2015-05-04 02:54:07','[Recoeve]--참고할만한 서비스들','Face