y Studio\nMixed by 조씨아저씨 @ Joelab\nMastered by 권남우 @ 821 Sound Mastering\n\n\n2. 4FIRE - 보고싶었어\n\"보고싶었어\"는 여름에 잘 어울리는 컨트리, 레게, R&B장르가 컬래버레이션 된 곡이다.\n추억 속 누군가를 그리워하는 많은 사람들이 이 노래를 통해 그리운 사람과 재회하는 기적의 순간에 서로가 \'보고싶었어\'라는 말을 툭 건네는 순간이 반드시 오길 바라는 마음에서 만든 곡으로 4FIRE 멤버인 나비, SOLE, 엄지윤, 권진아의 목소리로 밝은 분위기 속 아련한 감성을 녹여냈다.\n\n작곡 조영수\n작사 조영수, 한길\n편곡 조영수, 한길\n피아노 조영수\n키보드 한길\n기타 정수완\n코러스 나비, SOLE, 엄지윤, 권진아, 조영수\n레코딩 엔지니어 나수민\nBAKE SOUND 믹싱 엔지니어 최재영\nBAKE SOUND 마스터링 엔지니어 권남우\n\n\n3. 오아시소 - Clink Clink (클링 클링)\n“Clink Clink”은 “다시 만난 세계” (소녀시대) “중독” (EXO), “무한적아” (NCT127) 등으로 K-pop을 대표하는 작곡가인 KENZIE와, “Everybody” (샤이니), “Like Water” (웬디) 등의 히트곡을 작업해 온 Coach & Sendo가 Gabriel Brandes, Phat Fabe, Karen Poole 등 유럽의 유명 작곡가들과 함께 완성시킨 미디엄템포 팝곡이다.\n\n석양이 지고 별이 뜨는 여름 해변가의 감성이 묻어나는 가사와, 매력적인 기타 리프가 WSG워너비의 오아시소 멤버들의 각각의 개성을 담아내며, WSG워너비 프로젝트가 발매되는 여름의 계절감을 한껏 고조시킨다.\n\nComposed by KENZIE, Phat Fabe, Gabriel Brandes, Karen Poole, Coach & Sendo\nLyrics by KENZIE\nArranged by Coach & Sendo\nOriginal production by Phat Fabe\nVocal directed by Coach & Sendo\nOriginal publisher EKKO Music Rights (powered by CTGA), EKKO Music Rights Europe (powered by CTGA)\nSub-publisher EKKO Music Rights (powered by CTGA)\n\nBackground vocals by 윤은혜, 코타, 박진주, 조현아, 김숙, 신봉선, 권애진\nGuitar by 박성범\nBass by Coach, Sendo\nPiano by Coach, Sendo\nSynthesizer by Coach, Sendo\nDrum Programming by Coach, Sendo\nRecorded by 이강현 @ Vibe Music 606\nVocal edited by 권유진 @ doobdoob Studio\nMixed by 구종필 @ Klang Studio\nMastered by 권남우 @ 821 Sound Mastering\nProducer managed by amplified Co., Ltd.','','7.5/10',0,0,0),(100000000,'https://www.youtube.com/watch?v=7WyHtSlvHD4','2022-07-30 01:31:12','2022-07-30 01:31:12','[Music/Break]--K-Pop','BLACKPINK (블랙핑크) X PUBG MOBILE - Ready For Love','','','7.0/10',0,0,0),(100000000,'https://www.youtube.com/watch?v=7yxaVX2R90M','2016-05-07 07:30:10','2016-10-30 13:23:11','[Music/Break]--B-boy','Ducky vs Beast / Toprock Battle Final / Juste Debout 2013 Korea / Allthatbreak.com','','','9.1/10',0,0,0)