watch?v=icMnUAM9S34','2022-07-15 23:23:15','2022-07-15 23:23:15','[Recoeve]--참고할만한 서비스들','리뷰 앱 - 소우주','#무색큐브\n\n이걸 보고 난 스팀이 해결책이 되지 않을까 생각함\n현존하는 평가 기능이 있는 앱들은 하나같이 신뢰성을 잃은 반면에\n스팀은 유독 평가 신뢰성이 상당히 높은 편에 속함\n왜 스팀이 유독 그럴까? 스팀이 다른 게 뭘까? 했는데 네가지 정도가 나옴\n\n1. 평가를 평가할 수 있음\n스팀은 평가를 평가 할 수 있어서 좋은 평가를 받은 평가는 상단에 위치하고\n저급 평가는 좋지 못 한 평가라고 재평가 해서 구석에 박아버림\n이런 방식으로 저질 평가는 애초에 보지도 못하게 초기에 대처할 수 있게 해줌\n또, 좋은 평가를 받고 싶어서 평가를 정성스레 남기는 사람이 꼭 생기게 되는데,\n이런 평가는 상단에 바로 노출이 되기 때문에 높은 신뢰성과 전문성을 보장하게 됨\n\n2. 평가를 언제든 수정할 수 있음\n이건 양날의 검이 될 수 있다고 생각함\n게임은 지속적으로 플레이하기 때문에 관심을 기울이지만\n음식점 같은 경우에는 굳이 평가를 추후에 변경해주는 일이 적으니까\n나는 이 부분에서 관심을 다시 한번 기울이게 하면 되지 않을까? 생각했고\n과거 평가가 안 좋았던 곳이 평가가 좋아지면 사용자에게 노출 시켜서\n어? 이곳 많이 개선되었나보네? 하는 방식으로 다시 관심을 갖게 하면 어떨까 생각함\n현재 요기요 같은 플랫폼에서 5점에 목숨을 거는 이유가 평가가 유동적이지 않아서\n한번 별점이 깎이면 다시 복구하기가 매우 어렵기 때문이라고 생각함\n\n3. 별점 시스템이 아닌 평가 문구\n현재 대다수 평가앱은 1~5점을 주고 평균치를 보여주는 방식인데\n스팀은 (좋다 / 싫다) 하나만 선택하게 시킴\n그 중 좋다고 선택한 사람의 비율에 따라 압긍 / 매긍 / 대긍 / 복합 .... 이런 식으로 갈리는데\n70%만 넘기면 \"대체로 긍정적\"으로 표시해줌\n이 수치는 별점에서 3.5점쯤에 해당하는데 사용자가 보기에 훨씬 긍정적으로 와닿는다고 생각함\n3.5점 가게와 \"대체로 긍정적\" 가게 중 어느 가게에 가고 싶겠음?\n인간의 심리 상 5점 만점 4.5점은 되어야 좋은 가게라고 생각하게 되는데\n문구만 바꿔도 낮은 점수라도 훨씬 긍정적으로 받아들이게 됨\n이런 방식으로 사장님들이 만점에 목숨 걸지 않게 할 수도 있음\n또한 평가를 좋다 싫다 하나만 하게 시켜서 정말 구린 가게가 아닌 이상 \"좋음\"을 유도할 수도 있음\n\"3점\" 같은 경우에는 줘야 하는지 말아야 하는지 갑론을박이 정말 많은데 그냥 별점 시스템을 포기해서 밀어버릴 수 있다고 생각함\n\n4. 히스토리로 주작 방지\n스팀은 과거 특정 날짜에 좋싫비를 얼마나 받았는지 탐색할 수 있는데, 이런 방식으로 물타기를 방지할 수 있음\n특정 날짜 구간에만 좋아요, 싫어요가 왕창 몰려 있거나 평가가 유난히 많으면 주작질을 쉽게 감지하고 대처할 수 있음\n\n스팀의 평가 신뢰도가 무슨 절대적으로 높고 완전무결한 시스템은 아니지만\n충분히 참고할 만한 평가 시스템이라고 생각해서 도움이 되었으면 해서 남겨봄','내 서비스에서도 생각해 볼만한 글.','8.2/10',0,0,0),(100000000,'https://www.youtube.com/watch?v=iEe_eraFWWs','2019-07-26 02:42:42','2022-05-09 04:26:42','[Music/Break]--Pop','The Black Eyed Peas - My Humps','#lyrics\n\nWhatcha gonna do with all that junk\nAll that junk inside your trunk\n\nI\'ma get get get get you drunk\nGet you love drunk off my hump\nMy hump my hump my hump my hump my hump\nMy hump my hump my hump my lovely little lumps\n\nCheck 