\n#Explanation: The beautiful Trifid Nebula is a cosmic study in contrasts. Also known as M20, it lies about 5,000 light-years away toward the nebula rich constellation Sagittarius. A star forming region in the plane of our galaxy, the Trifid does illustrate three different types of astronomical nebulae; red emission nebulae dominated by light from hydrogen atoms, blue reflection nebulae produced by dust reflecting starlight, and dark nebulae where dense dust clouds appear in silhouette. But the red emission region roughly separated into three parts by obscuring dust lanes is what lends the Trifid its popular name. Pillars and jets sculpted by newborn stars, below and left of the emission nebula\'s center, appear in famous Hubble Space Telescope close-up images of the region. The Trifid Nebula is about 40 light-years across. Just too faint to be seen by the unaided eye, it almost covers the area of a full moon in planet Earth\'s sky.','','10.0/10',0,0,0),(100000043,'https://apod.nasa.gov/apod/image/2108/m74_APOD1024.jpg','2021-08-19 11:59:56','2021-08-19 11:59:56','[Music/Break]--Image test','A Perfect Spiral','#related\nhttps://apod.nasa.gov/apod/ap210813.html\n\n#Image Credit: NASA, ESA, Hubble, HLA; Processing: Mehmet Hakan Ozsarac\n#Explanation: If not perfect then this spiral galaxy is at least one of the most photogenic. An island universe of about 100 billion stars, 32 million light-years away toward the constellation Pisces, M74 presents a gorgeous face-on view. Classified as an Sc galaxy, the grand design of M74\'s graceful spiral arms are traced by bright blue star clusters and dark cosmic dust lanes. This sharp composite was constructed from image data recorded by the Hubble Space Telescope\'s Advanced Camera for Surveys. Spanning about 30,000 light-years across the face of M74, it includes exposures recording emission from hydrogen atoms, highlighting the reddish glow of the galaxy\'s large star-forming regions. With a lower surface brightness than most galaxies in the Messier catalog, M74 is sometimes known as the Phantom Galaxy.','','10.0/10',0,0,0),(100000043,'https://i.imgur.com/r3RMdYs.gif','2021-08-25 02:40:23','2021-08-25 02:40:23','[Music/Break]--Image test','남규리 만두','','','10.0/10',0,0,0),(100000043,'https://tv.kakao.com/v/421688114','2021-08-23 06:26:11','2021-08-23 08:02:58','[Music/Break]--Video test','더보이즈 - 스릴 라이드 (THE BOYZ - THRILL RIDE), MBC 210821 방송','','tv.kakao.com and entertain.daum.net','8.2/10',0,0,0),(100000043,'https://tv.naver.com/v/3081353','2021-08-19 07:24:39','2021-08-23 06:17:56','[Music/Break]--Video test','대답 자판기(?) 조세호의 합류! \'무한도전에 큰 도움\'','','네이버 tv','9.0/10',0,0,0),(100000043,'https://vimeo.com/216745735','2021-08-23 06:48:36','2021-08-23 08:03:27','[Music/Break]--Video test','SIGNAL','','vimeo.com','7.0/10',0,0,0),(100000043,'https://www.dailymotion.com/video/x83ltmx','2021-08-23 07:44:54','2021-08-23 08:04:12','[Music/Break]--Video test','[Comeback Stage] Red Velvet - Queendom, 레드벨벳 - 퀸덤 Show Music core 20210821','','dailymotion.com','7.2/10',0,0,0),(100000043,'https://www.instagram.com/p/CST3GJrh3Ar/','2021-08-23 09:24:24','2021-08-23 09:24:24','[Music/Break]--Image test','부화공주 가영 (남규리)','','','10.0/10',0,0,0),(100000043,'https://www.netflix.com/watch/70261674','2021-03-14 02:11:20','2021-03-14 02:17:25','[Music/Break]--Movie;[Music/Break]--Movie--Romance','어바웃 타임 (About time)','#related\nhttps://www.youtube.com/watch?v=T7A810duHvw','','8.0/10',0,0,0),(100000043,'https://www.netflix.com/watch/81440865?locale=ko-KR','2021-03-13 01:14:27','2021-03-13 02:22:52','[Music/Break]--Animation--귀멸의 칼날','귀멸의 칼날 1화 - 잔혹','','','7.0/10',0,0,0),(100000043,'https://www.netflix.com/watch/81440866?locale=ko-KR&trackId=155573560','2021-03-13 02:06:24','2021-03-13 02:23:11','[Music/Break]--Animation--귀멸의 칼날','귀멸의 칼날 2화 - 육성자 우로코다키 사콘지','','','7.4/10',0,0,0),(100000043,'https://www.netflix.com/watch/81440867?locale=ko-KR&trackId=155573560','2021-03-13 02:33:07','2021-03-13 03:06:16','[Music/Break